INSERT INTO `problem_attempts` VALUES (1, '2023-10-19 19:33:35.652', '2023-10-19 19:33:35.652', NULL, 91, 1, 1, 0, 1, '\r\n/**\r\n * class ListNode {\r\n *         int val;\r\n *         ListNode next;\r\n *         public ListNode(int val, ListNode next) {\r\n *             this.val = val;\r\n *             this.next = next;\r\n *         }\r\n *         public ListNode(int val) {\r\n *             this.val = val;\r\n *         }\r\n *     }\r\n */\r\nclass Solution {\r\n    public ListNode addTwoNumbers(ListNode l1, ListNode l2) {\r\n        ListNode head = null;\r\n        ListNode tail = null;\r\n        while (l1 != null || l2 != null) {\r\n            ListNode node = null;\r\n            if (l1 != null && l2 == null || (l1 != null && l2 != null && l1.val < l2.val)) {\r\n                node = l1;\r\n                l1 = l1.next;\r\n            } else {\r\n                node = l2;\r\n                l2 = l2.next;\r\n            }\r\n            if (head == null) {\r\n                head = node;\r\n                tail = node;\r\n            } else {\r\n                tail.next = node;\r\n                tail = tail.next;\r\n            }\r\n            return head;\r\n        }\r\n    }\r\n}\r\n', 'java', 'core_code', 1, NULL);
