INSERT INTO `problem_attempts` VALUES (9, '2024-11-23 23:15:23.069', '2024-11-23 23:15:23.069', NULL, 130, 1, 5, 5, 0, 'package main\r\n\r\nimport \"fmt\"\r\n\r\n\r\n// https://leetcode.cn/problems/find-first-and-last-position-of-element-in-sorted-array/description/?envType=problem-list-v2&envId=binary-search\r\nfunc main() {\r\n    nums := []int{4,5,6,7,0,1,2}\r\n    l := find(nums)\r\n    fmt.Printf(\"%d\", l)\r\n}\r\n\r\nfunc find(nums []int) int {\r\n	left := 0\r\n    right := len(nums) - 1\r\n    for left < right {\r\n        mid := (left + right) / 2\r\n        if nums[mid] > nums[right] {\r\n            left = mid + 1\r\n        } else {\r\n            right = mid\r\n        }\r\n    }\r\n    return left\r\n}', 'go', NULL, 2, NULL);
