INSERT INTO `problem_attempts` VALUES (20, '2024-11-24 16:39:44.478', '2024-11-24 16:39:44.478', NULL, 114, 1, 1, 1, 0, 'package main\r\n\r\nimport (\r\n    \"fmt\"\r\n    \"math\"\r\n)\r\n\r\nfunc main() {\r\n    var n int\r\n    fmt.Scanln(&n)\r\n\r\n    isPrime := make([]bool, n+1)\r\n    for i := range isPrime {\r\n        isPrime[i] = true\r\n    }\r\n    isPrime[0] = false\r\n    isPrime[1] = false\r\n\r\n    for i := 2; i <= int(math.Sqrt(float64(n))); i++ {\r\n        if isPrime[i] {\r\n            for j := i * i; j <= n; j += i {\r\n                isPrime[j] = false\r\n            }\r\n            }\r\n        }\r\n\r\n    for i := 2; i <= n; i++ {\r\n        if isPrime[i] {\r\n            fmt.Printf(\"%d \", i)\r\n        }\r\n    }\r\n}', 'go', NULL, 2, NULL);
INSERT INTO `problem_attempts` VALUES (21, '2024-11-24 16:43:10.801', '2024-11-24 16:43:10.801', NULL, 115, 1, 1, 1, 0, 'package main\r\n\r\nimport \"fmt\"\r\n\r\nfunc main() {\r\n    for num := 100; num < 1000; num++ {\r\n        hundreds := num / 100\r\n        tens := (num / 10) % 10\r\n        units := num % 10\r\n\r\n        if hundreds*hundreds*hundreds+tens*tens*tens+units*units*units == num {\r\n            fmt.Printf(\"%d \", num)\r\n        }\r\n    }\r\n}', 'go', NULL, 2, NULL);
INSERT INTO `problem_attempts` VALUES (22, '2024-11-24 16:44:58.320', '2024-11-24 16:44:58.320', NULL, 116, 1, 1, 1, 0, 'package main\r\n\r\nimport \"fmt\"\r\n\r\nfunc main() {\r\n    var n int\r\n    fmt.Scanln(&n)\r\n\r\n    fmt.Printf(\"%d=\", n)\r\n\r\n    // 从最小的质数2开始尝试分解\r\n    for i := 2; i <= n; i++ {\r\n        // 如果当前数能被i整除，且i是质数\r\n        for n%i == 0 && isPrime(i) {\r\n            n /= i\r\n            if n!= 1 {\r\n                fmt.Printf(\"%d*\", i)\r\n            } else {\r\n                fmt.Printf(\"%d\", i)\r\n            }\r\n            i = 1\r\n        }\r\n    }\r\n}\r\n\r\n// 判断一个数是否为质数\r\nfunc isPrime(num int) bool {\r\n    if num <= 1 {\r\n        return false\r\n    }\r\n    if num <= 3 {\r\n        return true\r\n    }\r\n    if num%2 == 0 || num%3 == 0 {\r\n        return false\r\n    }\r\n\r\n    i := 5\r\n    for i*i <= num {\r\n        if num%i == 0 || num%(i+2) == 0 {\r\n            return false\r\n        }\r\n        i += 6\r\n    }\r\n\r\n    return true\r\n}', 'go', NULL, 2, NULL);
INSERT INTO `problem_attempts` VALUES (23, '2024-11-24 16:46:15.473', '2024-11-24 16:46:15.473', NULL, 117, 1, 9, 1, 8, 'package main\r\n\r\nimport \"fmt\"\r\n\r\nfunc gcd(x, y int) int {\r\n	tmp := x % y\r\n	if tmp > 0 {\r\n		return gcd(y, tmp)\r\n	} else {\r\n		return y\r\n	}\r\n}\r\n\r\n// 求最小公倍数\r\nfunc lcm(m, n int) int {\r\n	return m * n / gcd(m, n)\r\n}\r\n\r\nfunc main() {\r\n	var m, n int\r\n	fmt.Scan(&m)\r\n	fmt.Scan(&n)\r\n	fmt.Printf(\"%d %d\\n\", gcd(m, n), lcm(m, n))\r\n}', 'go', NULL, 2, NULL);
