INSERT INTO `problem_attempts` VALUES (25, '2024-11-24 16:57:57.875', '2024-11-24 16:57:57.875', NULL, 119, 1, 5, 1, 4, 'package main\r\n\r\nimport \"fmt\"\r\n\r\n// 链表节点结构体\r\ntype ListNode struct {\r\n    Val  int\r\n    Next *ListNode\r\n}\r\n\r\nfunc main() {\r\n    var n int\r\n    fmt.Scanln(&n)\r\n\r\n    // 创建初始链表，只有一个元素1\r\n    head := &ListNode{Val: 1}\r\n\r\n    for i := 0; i < n; i++ {\r\n        var op, x, y int\r\n        fmt.Scanln(&op, &x, &y)\r\n\r\n        switch op {\r\n        case 1:\r\n            insertNode(head, x, y)\r\n        case 2:\r\n            result := queryNext(head, x)\r\n            fmt.Println(result)\r\n        case 3:\r\n            deleteNext(head, x)\r\n        }\r\n    }\r\n}\r\n\r\n// 插入节点函数\r\nfunc insertNode(head *ListNode, x, y int) {\r\n    cur := head\r\n    for cur!= nil {\r\n        if cur.Val == x {\r\n            newNode := &ListNode{Val: y}\r\n            newNode.Next = cur.Next\r\n            cur.Next = newNode\r\n            break\r\n        }\r\n        cur = cur.Next\r\n    }\r\n}\r\n\r\n// 查询后继元素函数\r\nfunc queryNext(head *ListNode, x int) int {\r\n    cur := head\r\n    for cur!= nil {\r\n        if cur.Val == x {\r\n            if cur.Next == nil {\r\n                return 0\r\n            }\r\n            return cur.Next.Val\r\n        }\r\n        cur = cur.Next\r\n    }\r\n    return 0\r\n}\r\n\r\n// 删除后继元素函数\r\nfunc deleteNext(head *ListNode, x int) {\r\n    cur := head\r\n    for cur!= nil {\r\n        if cur.Val == x {\r\n            if cur.Next!= nil {\r\n                cur.Next = cur.Next.Next\r\n            }\r\n            break\r\n        }\r\n        cur = cur.Next\r\n    }\r\n}', 'go', NULL, 2, NULL);
INSERT INTO `problem_attempts` VALUES (26, '2024-11-24 17:05:05.296', '2024-11-24 17:05:05.296', NULL, 120, 1, 3, 1, 2, 'package main\r\n\r\nimport (\r\n    \"fmt\"\r\n)\r\n\r\n// 链表节点结构体\r\ntype ListNode struct {\r\n    Val  int\r\n    Next *ListNode\r\n}\r\n\r\n// 反转链表函数\r\nfunc reverseList(pHead *ListNode) *ListNode {\r\n    var prev *ListNode\r\n    cur := pHead\r\n\r\n    for cur!= nil {\r\n        next := cur.Next\r\n        cur.Next = prev\r\n        prev = cur\r\n        cur = next\r\n    }\r\n\r\n    return prev\r\n}\r\n\r\nfunc main() {\r\n    var n int\r\n    fmt.Scan(&n)\r\n\r\n    var head *ListNode\r\n    var tail *ListNode\r\n\r\n    for i := 0; i < n; i++ {\r\n        var val int\r\n        fmt.Scan(&val)\r\n\r\n        newNode := &ListNode{Val: val}\r\n\r\n        if head == nil {\r\n            head = newNode\r\n            tail = newNode\r\n        } else {\r\n            tail.Next = newNode\r\n            tail = newNode\r\n        }\r\n    }\r\n\r\n    reversedHead := reverseList(head)\r\n\r\n    for reversedHead!= nil {\r\n        fmt.Printf(\"%d \", reversedHead.Val)\r\n        reversedHead = reversedHead.Next\r\n    }\r\n}\r\n', 'go', NULL, 2, NULL);
INSERT INTO `problem_attempts` VALUES (27, '2024-11-24 17:07:09.455', '2024-11-24 17:07:09.455', NULL, 121, 1, 9, 1, 8, 'package main\r\n\r\nimport (\r\n    \"fmt\"\r\n)\r\n\r\nfunc twoSum(nums []int, target int) []int {\r\n    for i, num1 := range nums {\r\n        for j, num2 := range nums {\r\n            if i != j && num1 + num2 == target {\r\n                return []int{i, j}\r\n            }\r\n        }\r\n    }\r\n    return []int{-1, -1}\r\n}\r\n\r\nfunc main() {\r\n    var n int\r\n    fmt.Scan(&n)\r\n\r\n    nums := make([]int, n)\r\n    for i := 0; i < n; i++ {\r\n        fmt.Scan(&nums[i])\r\n    }\r\n\r\n    var target int\r\n    fmt.Scan(&target)\r\n\r\n    result := twoSum(nums, target)\r\n    fmt.Println(result[0], result[1])\r\n}', 'go', NULL, 2, NULL);
INSERT INTO `problem_attempts` VALUES (28, '2024-11-24 17:19:17.008', '2024-11-24 17:19:17.008', NULL, 122, 1, 10, 1, 9, 'package main\r\n\r\nimport \"fmt\"\r\n\r\nfunc lengthOfLongestSubstring(s string) int {\r\n    // guard clauses，也就是卫语句，在递归中非常重要\r\n    if len(s) <= 1 {\r\n        return len(s)\r\n    }\r\n    // 全局的字符串，用于保存\r\n    var mp = make(map[byte]int)\r\n    var i int\r\n    for i = 0 ;i < len(s); i++ {\r\n        if _, ok := mp[s[i]]; ok {\r\n            break // 找到重复的，直接退出\r\n        } else {\r\n            mp[s[i]] = i // 没找到重复的，加上这个子串\r\n        }\r\n    }\r\n\r\n    length := lengthOfLongestSubstring(s[1:])\r\n    if i > length {\r\n        return i\r\n    }\r\n    return length\r\n}\r\n\r\nfunc main() {\r\n    var s string\r\n    fmt.Scan(&s)\r\n\r\n    result := lengthOfLongestSubstring(s)\r\n    fmt.Println(result)\r\n}', 'go', NULL, 2, NULL);
INSERT INTO `problem_attempts` VALUES (29, '2024-11-24 18:10:45.715', '2024-11-24 18:10:45.715', NULL, 123, 1, 2, 1, 1, 'package main\r\n\r\nimport (\r\n    \"fmt\"\r\n)\r\n\r\nfunc longestPalindrome(s string) string {\r\n    n := len(s)\r\n    if n < 2 {\r\n        return s\r\n    }\r\n\r\n    maxLen := 1\r\n    begin := 0\r\n\r\n    // 中心扩展法\r\n    for i := 0; i < n; i++ {\r\n        oddLen := expandAroundCenter(s, i, i)\r\n        evenLen := expandAroundCenter(s, i, i+1)\r\n        curLen := max(oddLen, evenLen)\r\n\r\n        if curLen > maxLen {\r\n            maxLen = curLen\r\n            begin = i - (curLen-1)/2\r\n        }\r\n    }\r\n\r\n    return s[begin : begin+maxLen]\r\n}\r\n\r\nfunc expandAroundCenter(s string, left, right int) int {\r\n    L, R := left, right\r\n    n := len(s)\r\n\r\n    for L >= 0 && R < n && s[L] == s[R] {\r\n        L--\r\n        R++\r\n    }\r\n\r\n    return R - L - 1\r\n}\r\n\r\nfunc max(a, b int) int {\r\n    if a > b {\r\n        return a\r\n    }\r\n    return b\r\n}\r\n\r\nfunc main() {\r\n    var s string\r\n    fmt.Scan(&s)\r\n\r\n    result := longestPalindrome(s)\r\n    fmt.Println(result)\r\n}', 'go', NULL, 2, NULL);
INSERT INTO `problem_attempts` VALUES (30, '2024-11-24 18:11:42.259', '2024-11-24 18:11:42.259', NULL, 124, 1, 4, 1, 3, 'package main\r\n\r\nimport \"fmt\"\r\n\r\nfunc convert(s string, numRows int) string {\r\n    // 很巧妙 头尾转变方向\r\n    arr := make([]string, numRows)\r\n    if numRows < 2 {\r\n        return s\r\n    }\r\n\r\n    i, flag := 0, -1\r\n    for _, v := range s {\r\n        arr[i] += string(v)\r\n        if i == 0 || i == numRows -1 {\r\n            flag = -flag\r\n        }\r\n        i += flag\r\n    }\r\n\r\n    var result string\r\n    for i := 0; i < len(arr); i++ {\r\n        result += arr[i]\r\n    }\r\n\r\n    return result\r\n}\r\n\r\n\r\nfunc main() {\r\n    var s string\r\n    fmt.Scan(&s)\r\n\r\n    var numRows int\r\n    fmt.Scan(&numRows)\r\n\r\n    output := convert(s, numRows)\r\n    fmt.Println(output)\r\n}', 'go', NULL, 2, NULL);
INSERT INTO `problem_attempts` VALUES (31, '2024-11-24 18:16:46.515', '2024-11-24 18:16:46.515', NULL, 125, 1, 4, 1, 3, 'package main\r\n\r\nimport \"fmt\"\r\n\r\n// reverse函数用于反转一个32位有符号整数\r\nfunc reverse(x int) int {\r\n    // 定义32位有符号整数的最小值和最大值\r\n    const INT_MIN = -1 << 31\r\n    const INT_MAX = 1<<31 - 1\r\n\r\n    // 用于存储反转后的整数\r\n    var reversed int\r\n\r\n    // 根据输入整数的正负确定符号\r\n    sign := 1\r\n    if x < 0 {\r\n        sign = -1\r\n        x = -x\r\n    }\r\n\r\n    // 循环进行数字反转操作\r\n    for x!= 0 {\r\n        // 取出当前整数的最后一位数字\r\n        lastDigit := x % 10\r\n\r\n        // 检查是否会发生溢出\r\n        if reversed > INT_MAX/10 || (reversed == INT_MAX/10 && lastDigit > INT_MAX%10) {\r\n            return 0\r\n        }\r\n        if reversed < INT_MIN/10 || (reversed == INT_MIN/10 && lastDigit < INT_MIN%10) {\r\n            return 0\r\n        }\r\n\r\n        // 将取出的数字添加到反转后的整数中\r\n        reversed = reversed*10 + lastDigit\r\n\r\n        // 更新原整数，去掉已经处理过的最后一位数字\r\n        x /= 10\r\n    }\r\n\r\n    // 返回反转后的整数，并根据原整数的符号进行调整\r\n    return reversed * sign\r\n}\r\n\r\nfunc main() {\r\n    // 示例输入\r\n    num := 0\r\n    fmt.Scan(&num)\r\n    num = reverse(num)\r\n    fmt.Println(num)\r\n}', 'go', NULL, 2, NULL);
INSERT INTO `problem_attempts` VALUES (32, '2024-11-24 18:20:59.870', '2024-11-24 18:20:59.870', NULL, 126, 1, 1, 1, 0, 'package main\r\n\r\nimport \"fmt\"\r\n\r\n// isPalindrome函数用于判断一个整数是否为回文整数\r\nfunc isPalindrome(a int) bool {\r\n    if a < 0 {\r\n        return false\r\n    }\r\n\r\n    // 将整数转换为字符串\r\n    numStr := fmt.Sprintf(\"%d\", a)\r\n\r\n    // 遍历字符串的前半部分和后半部分进行比较\r\n    for i := 0; i < len(numStr)/2; i++ {\r\n        if numStr[i]!= numStr[len(numStr)-1-i] {\r\n            return false\r\n        }\r\n    }\r\n\r\n    return true\r\n}\r\n\r\nfunc main() {\r\n    // 示例输入\r\n    num := 0\r\n    fmt.Scan(&num)\r\n    a := isPalindrome(num)\r\n    fmt.Println(a)\r\n}', 'go', NULL, 2, NULL);
INSERT INTO `problem_attempts` VALUES (33, '2024-11-24 18:22:38.530', '2024-11-24 18:22:38.530', NULL, 127, 1, 4, 1, 3, 'package main\r\n\r\nimport \"fmt\"\r\n\r\n// maxArea函数用于找出给定数组中两条垂线与x轴构成容器能容纳的最大水量\r\nfunc maxArea(height []int) int {\r\n    left, right := 0, len(height)-1\r\n    maxWater := 0\r\n\r\n    for left < right {\r\n        // 计算当前两条垂线构成容器的水量\r\n        currentArea := min(height[left], height[right]) * (right - left)\r\n        // 更新最大水量\r\n        if currentArea > maxWater {\r\n            maxWater = currentArea\r\n        }\r\n\r\n        // 根据垂线高度调整指针\r\n        if height[left] < height[right] {\r\n            left++\r\n        } else {\r\n            right--\r\n        }\r\n    }\r\n\r\n    return maxWater\r\n}\r\n\r\n// min函数用于返回两个整数中的较小值\r\nfunc min(a, b int) int {\r\n    if a < b {\r\n        return a\r\n    }\r\n    return b\r\n}\r\n\r\nfunc main() {\r\n    n := 0\r\n    fmt.Scan(&n)\r\n    nums := make([]int, n)\r\n    for i := 0; i < n; i++ {\r\n        fmt.Scan(&nums[i])\r\n    }\r\n    answer := maxArea(nums)\r\n    fmt.Println(answer)\r\n}', 'go', NULL, 2, NULL);
INSERT INTO `problem_attempts` VALUES (34, '2024-11-24 18:26:58.668', '2024-11-24 18:26:58.668', NULL, 128, 1, 1, 1, 0, 'package main\r\n\r\nimport \"fmt\"\r\n\r\n// climbStairs函数用于计算爬到指定台阶数的不同方法数\r\nfunc climbStairs(n int) int {\r\n    if n == 1 {\r\n        return 1\r\n    }\r\n\r\n    a, b := 1, 2\r\n    for i := 2; i < n; i++ {\r\n        c := a + b\r\n        a = b\r\n        b = c\r\n    }\r\n\r\n    return b\r\n}\r\n\r\nfunc main() {\r\n    num := 0\r\n    fmt.Scan(&num)\r\n    answer := climbStairs(num)\r\n    fmt.Println(answer)\r\n}', 'go', NULL, 2, NULL);
INSERT INTO `problem_attempts` VALUES (35, '2024-11-24 18:28:20.880', '2024-11-24 18:28:20.880', NULL, 129, 1, 3, 1, 2, 'package main\r\n\r\nimport (\r\n    \"fmt\"\r\n    \"strconv\"\r\n)\r\n\r\n// addBinary函数用于计算两个二进制字符串的和，并以二进制字符串形式返回结果\r\nfunc addBinary(a, b string) string {\r\n    // 将二进制字符串转换为整数\r\n    num1, err1 := strconv.ParseInt(a, 2, 64)\r\n    num2, err2 := strconv.ParseInt(b, 2, 64)\r\n\r\n    if err1!= nil || err2!= nil {\r\n        return \"\"\r\n    }\r\n\r\n    // 计算两数之和\r\n    sum := num1 + num2\r\n\r\n    // 将和转换为二进制字符串\r\n    return strconv.FormatInt(sum, 2)\r\n}\r\n\r\nfunc main() {\r\n    a := \"\"\r\n    b := \"\"\r\n    fmt.Scan(&a)\r\n    fmt.Scan(&b)\r\n    result := addBinary(a, b)\r\n    fmt.Println(result)\r\n}\r\n', 'go', NULL, 2, NULL);
INSERT INTO `problem_attempts` VALUES (36, '2024-11-25 01:55:17.234', '2024-11-25 01:55:17.234', NULL, 130, 24, 2, 2, 0, 'package main\r\n\r\nimport \"fmt\"\r\n\r\n\r\nfunc binarySearch(nums []int, target int) int {\r\n    left, right := 0, len(nums)-1\r\n\r\n    for left <= right {\r\n        mid := left + (right-left)/2\r\n\r\n        if nums[mid] == target {\r\n            return mid\r\n        } else if nums[mid] < target {\r\n            left = mid + 1\r\n        } else {\r\n            right = mid - 1\r\n        }\r\n    }\r\n\r\n    return -1\r\n}\r\nfunc main() {\r\n    nums := []int{1, 3, 5, 7, 9, 11, 13}\r\n    target := 7\r\n    result := binarySearch(nums, target)\r\n    if result!= -1 {\r\n        fmt.Printf(\"目标值 %d 在数组中的索引为 %d\\n\", target, result)\r\n    } else {\r\n        fmt.Printf(\"数组中未找到目标值 %d\\n\", target)\r\n    }\r\n}', 'go', NULL, 2, NULL);
