INSERT INTO `problem_attempts` VALUES (45, '2024-11-26 20:23:37.580', '2024-11-26 20:23:37.580', NULL, 130, 27, 2, 2, 0, 'package main\r\n\r\nimport \"fmt\"\r\n\r\n\r\nfunc binarySearch(nums []int, target int) int {\r\n    left, right := 0, len(nums)-1\r\n	haha := 123\r\n	ha := 1\r\n    for left <= right {\r\n        mid := left + (right-left)/2\r\n\r\n        if nums[mid] == target {\r\n            return mid\r\n        } else if nums[mid] < target {\r\n            left = mid + 1\r\n        } else {\r\n            right = mid - 1\r\n        }\r\n    }\r\n\r\n    return -1+haha+ha\r\n}\r\nfunc main() {\r\n    nums := []int{1, 3, 5, 7, 9, 11, 13}\r\n    target := 7\r\n    result := binarySearch(nums, target)\r\n    if result!= -1 {\r\n        fmt.Printf(\"目标值 %d 在数组中的索引为 %d\\n\", target, result)\r\n    } else {\r\n        fmt.Printf(\"数组中未找到目标值 %d\\n\", target)\r\n    }\r\n}', 'go', NULL, 2, NULL);
INSERT INTO `problem_attempts` VALUES (46, '2024-12-29 17:11:47.649', '2024-12-29 17:11:47.649', NULL, 131, 1, 1, 1, 0, 'package main\r\n\r\nimport (\r\n	\"fmt\"\r\n)\r\n\r\ntype LinkNode struct {\r\n    Val int\r\n    Next *LinkNode\r\n    Prev *LinkNode\r\n}\r\n\r\nfunc main() {\r\n	nums := []int{1, 2, 3, 4}\r\n    header := buildLink(nums)\r\n    node := header\r\n    for node != nil {\r\n        fmt.Println(node.Val)\r\n        node = node.Next\r\n    }\r\n}\r\n\r\nfunc buildLink(nums []int) *LinkNode {\r\n    var header, tail *LinkNode\r\n    for num := range nums {\r\n        node := &LinkNode{Val:num}\r\n        if header == nil {\r\n            header = node\r\n            tail = node\r\n        } else {\r\n            tail.Next = node\r\n            node.Prev = tail\r\n            tail = tail.Next\r\n        }\r\n    }\r\n    return header\r\n}\r\n', 'go', NULL, 2, NULL);
