INSERT INTO `problems` VALUES (2, '2023-07-25 10:18:28.000', '2024-11-23 21:08:17.094', NULL, '两数之和', '给两个数计算总和', '2', 'tow-sum', '# 两数之和\r\n\r\n简单\r\n给定一个整数数组 nums 和一个整数目标值 target，请你在该数组中找出 和为目标值 target  的那 两个 整数，并返回它们的数组下标。\r\n\r\n你可以假设每种输入只会对应一个答案。但是，数组中同一个元素在答案里不能重复出现。\r\n\r\n你可以按任意顺序返回答案。\r\n\r\n \r\n\r\n- 核心代码示例\r\n\r\n  示例 1：\r\n\r\n  ~~~c\r\n  输入：nums = [2,7,11,15], target = 9\r\n  输出：[0,1]\r\n  解释：因为 nums[0] + nums[1] == 9 ，返回 [0, 1] 。\r\n  ~~~\r\n\r\n  示例 2：\r\n\r\n  ~~~c\r\n  输入：nums = [3,2,4], target = 6\r\n  输出：[1,2]\r\n  ~~~\r\n\r\n  示例 3：\r\n\r\n  ~~~c\r\n  输入：nums = [3,3], target = 6\r\n  输出：[0,1]\r\n  ~~~\r\n\r\n- acm示例\r\n\r\n  示例 1：\r\n\r\n  输入：\r\n\r\n  ~~~c\r\n  4\r\n  2 7 11 15\r\n  9\r\n  ~~~\r\n\r\n  输出：\r\n\r\n  ~~~c\r\n  0 1\r\n  ~~~\r\n\r\n  \r\n\r\n  示例 2：\r\n\r\n  输入：\r\n\r\n  ~~~c\r\n  3\r\n  3 2 4\r\n  6\r\n  ~~~\r\n\r\n  输出：\r\n\r\n  ~~~c\r\n  1 2\r\n  ~~~\r\n\r\n\r\n\r\n提示：\r\n\r\n2 <= nums.length <= 104\r\n-109 <= nums[i] <= 109\r\n-109 <= target <= 109\r\n只会存在一个有效答案\r\n\r\n\r\n\r\n**进阶：你可以想出一个时间复杂度小于 O(n2) 的算法吗？**', 0, 1, 'go', NULL, 18);
INSERT INTO `problems` VALUES (91, '2023-10-09 17:33:38.987', '2024-11-23 21:08:23.339', NULL, '两数相加', '两数相加', '91', 'add-two-numbers', '# 两数相加\r\n\r\n给你两个 **非空** 的链表，表示两个非负的整数。它们每位数字都是按照 **逆序** 的方式存储的，并且每个节点只能存储 **一位** 数字。\r\n\r\n请你将两个数相加，并以相同形式返回一个表示和的链表。\r\n\r\n你可以假设除了数字 0 之外，这两个数都不会以 0 开头。\r\n\r\n- 核心代码示例\r\n\r\n  示例 1：\r\n\r\n  ~~~\r\n  输入：l1 = [2,4,3], l2 = [5,6,4]\r\n  输出：[7,0,8]\r\n  解释：342 + 465 = 807.\r\n  ~~~\r\n\r\n  示例 2：\r\n\r\n  ~~~\r\n  输入：l1 = [0], l2 = [0]\r\n  输出：[0]\r\n  ~~~\r\n\r\n  示例3：\r\n\r\n  ~~~\r\n  输入：l1 = [9,9,9,9,9,9,9], l2 = [9,9,9,9]\r\n  输出：[8,9,9,9,0,0,0,1]\r\n  ~~~\r\n\r\n- acm模式\r\n\r\n  示例1：\r\n\r\n  ~~~\r\n  3\r\n  2 4 3\r\n  3\r\n  5 6 4\r\n  ~~~\r\n\r\n  输出：\r\n\r\n  ~~~\r\n  7 0 8\r\n  ~~~\r\n\r\n  示例2：\r\n\r\n  ~~~\r\n  1\r\n  0\r\n  1\r\n  0\r\n  ~~~\r\n\r\n  输出：\r\n\r\n  ~~~\r\n  0\r\n  ~~~\r\n\r\n**提示：**\r\n\r\n- 每个链表中的节点数在范围 `[1, 100]` 内\r\n- `0 <= Node.val <= 9`\r\n- 题目数据保证列表表示的数字不含前导零', 0, 2, 'go', 1, 18);
INSERT INTO `problems` VALUES (92, '2023-10-09 17:33:45.277', '2023-10-09 17:33:45.277', '2023-10-09 18:12:34.140', '未命名题目', '标题信息', '', '未命名编号1696844024594', '给定一个整数数组 `nums `和一个整数目标值` target`，请你在该数组中找出 和为目标值 `target`  的那 两个 整数，并返回它们的数组下标。\r\n\r\n你可以假设每种输入只会对应一个答案。但是，数组中同一个元素在答案里不能重复出现。\r\n\r\n你可以按任意顺序返回答案。\r\n\r\n示例 1：\r\n\r\n~~~java\r\n输入：nums = [2,7,11,15], target = 9\r\n输出：[0,1]\r\n解释：因为 nums[0] + nums[1] == 9 ，返回 [0, 1] 。\r\n~~~\r\n\r\n示例 2：\r\n\r\n~~~java\r\n输入：nums = [3,2,4], target = 6\r\n输出：[1,2]\r\n~~~\r\n\r\n示例 3：\r\n\r\n~~~java\r\n输入：nums = [3,3], target = 6\r\n输出：[0,1]\r\n~~~\r\n\r\n\r\n提示：\r\n\r\n- `2 <= nums.length <= 104`\r\n- `-109 <= nums[i] <= 109`\r\n- `-109 <= target <= 109`\r\n  只会存在一个有效答案', -1, 1, '', 1, NULL);
