INSERT INTO `submissions` VALUES (1, '2023-10-19 19:33:35.201', '2023-10-19 19:33:35.201', NULL, 1, 91, 'core_code', 'java', '\r\n/**\r\n * class ListNode {\r\n *         int val;\r\n *         ListNode next;\r\n *         public ListNode(int val, ListNode next) {\r\n *             this.val = val;\r\n *             this.next = next;\r\n *         }\r\n *         public ListNode(int val) {\r\n *             this.val = val;\r\n *         }\r\n *     }\r\n */\r\nclass Solution {\r\n    public ListNode addTwoNumbers(ListNode l1, ListNode l2) {\r\n        ListNode head = null;\r\n        ListNode tail = null;\r\n        while (l1 != null || l2 != null) {\r\n            ListNode node = null;\r\n            if (l1 != null && l2 == null || (l1 != null && l2 != null && l1.val < l2.val)) {\r\n                node = l1;\r\n                l1 = l1.next;\r\n            } else {\r\n                node = l2;\r\n                l2 = l2.next;\r\n            }\r\n            if (head == null) {\r\n                head = node;\r\n                tail = node;\r\n            } else {\r\n                tail.next = node;\r\n                tail = tail.next;\r\n            }\r\n            return head;\r\n        }\r\n    }\r\n}\r\n', 203, 'exit status 2', '', '', '', '', 0, 0, NULL);
INSERT INTO `submissions` VALUES (2, '2023-11-29 23:34:38.805', '2023-11-29 23:34:38.805', NULL, 1, 2, 'core_code', 'java', 'class Solution {\r\n    public int[] twoSum(int[] nums, int target) {\r\n        int n = nums.length;\r\n        for (int i = 0; i < n; ++i) {\r\n            for (int j = i + 1; j < n; ++j) {\r\n                if (nums[i] + nums[j] == target) {\r\n                    return new int[]{i, j};\r\n                }\r\n            }\r\n        }\r\n        return new int[0];\r\n    }\r\n}', 202, '', '3', '22\n90 83 24 40 33 60 27 48 19 57 38 8 25 37 71 50 91 35 25 39 28 46\n99\n', '17 19\n', '5 19\n', 0, 0, NULL);
INSERT INTO `submissions` VALUES (3, '2023-12-26 00:50:46.579', '2023-12-26 00:50:46.579', NULL, 1, 2, NULL, 'java', 'class Solution {\r\n    public int[] twoSum(int[] nums, int target) {\r\n        int n = nums.length;\r\n        for (int i = 0; i < n; ++i) {\r\n            for (int j = i + 1; j < n; ++j) {\r\n                if (nums[i] + nums[j] == target) {\r\n                    return new int[]{i, j};\r\n                }\r\n            }\r\n        }\r\n        return new int[0];\r\n    }\r\n}', 204, 'Error: Could not find or load main class Main\nCaused by: java.lang.ClassNotFoundException: Main\n', '', '', '', '', 0, 0, NULL);
INSERT INTO `submissions` VALUES (4, '2023-12-26 00:54:35.859', '2023-12-26 00:54:35.859', NULL, 1, 2, NULL, 'java', 'import java.util.Scanner;\r\nimport java.util.*;\r\n// 注意类名必须为 Main, 不要有任何 package xxx 信息\r\npublic class Main {\r\n    public static void main(String[] args) {\r\n        Scanner in = new Scanner(System.in);\r\n        int n = in.nextInt();\r\n        int[] nums = new int[n];\r\n        for (int i = 0; i < n; i++) {\r\n            nums[i] = in.nextInt();\r\n        }\r\n        int target = in.nextInt();\r\n        Map<Integer, Integer> map = new HashMap<>();\r\n        for (int i = 0; i < n; i++) {\r\n            if(map.containsKey(target - nums[i])) {\r\n                System.out.println(\"\" + map.get(target - nums[i]) + \" \" + i);\r\n                return;\r\n            }\r\n            if (!map.containsKey(nums[i])) {\r\n                map.put(nums[i], i);\r\n            }\r\n        }\r\n    }\r\n}', 200, '', '', '', '', '', 261428170, 0, NULL);
