INSERT INTO `submissions` VALUES (8, '2024-03-03 22:21:59.689', '2024-03-03 22:21:59.689', NULL, 1, 2, NULL, 'java', 'import java.util.Scanner;\r\nimport java.util.*;\r\n// 注意类名必须为 Main, 不要有任何 package xxx 信息\r\npublic class Main {\r\n    public static void main(String[] args) {\r\n        Scanner in = new Scanner(System.in);\r\n        int n = in.nextInt();\r\n        int[] nums = new int[n];\r\n        for (int i = 0; i < n; i++) {\r\n            nums[i] = in.nextInt();\r\n        }\r\n        int target = in.nextInt();\r\n        Map<Integer, Integer> map = new HashMap<>();\r\n        for (int i = 0; i < n; i++) {\r\n            if(map.containsKey(target - nums[i])) {\r\n                System.out.println(\"\" + map.get(target - nums[i]) + \" \" + i);\r\n                return;\r\n            }\r\n            if (!map.containsKey(nums[i])) {\r\n                map.put(nums[i], i);\r\n            }\r\n        }\r\n    }\r\n}', 200, '', '', '', '', '', 7408691353, 0, NULL);
