INSERT INTO `submissions` VALUES (46, '2024-11-17 20:37:59.839', '2024-11-17 20:37:59.839', NULL, 1, 103, NULL, 'go', 'package main\r\n\r\nimport (\r\n	\"fmt\"\r\n)\r\n\r\nfunc main() {\r\n	var n int\r\n    fmt.Scan(&n)\r\n    arr := make([]int,0)\r\n    for i := 0; i < n + 3; i++ {\r\n        var t int\r\n        fmt.Scan(&t)\r\n        arr = append(arr, t)\r\n    }\r\n    answer := 0\r\n    for _, a := range arr {\r\n        answer += a\r\n    }\r\n    fmt.Printf(\"%d\", answer)\r\n}\r\n', 200, '', '', '', '', '', 9783540, 0, NULL);
INSERT INTO `submissions` VALUES (47, '2024-11-23 23:15:22.950', '2024-12-26 00:46:17.389', NULL, 1, 130, NULL, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\n\r\nfunc binarySearch(nums []int, target int) int {\r\n    left, right := 0, len(nums)-1\r\n\r\n    for left <= right {\r\n        mid := left + (right-left)/2\r\n\r\n        if nums[mid] == target {\r\n            return mid\r\n        } else if nums[mid] < target {\r\n            left = mid + 1\r\n        } else {\r\n            right = mid - 1\r\n        }\r\n    }\r\n\r\n    return -1\r\n}\r\nfunc main() {\r\n    nums := []int{1, 3, 5, 7, 9, 11, 13}\r\n    target := 9\r\n    result := binarySearch(nums, target)\r\n    if result!= -1 {\r\n        fmt.Printf(\"目标值 %d 在数组中的索引为 %d\\n\", target, result)\r\n    } else {\r\n        fmt.Printf(\"数组中未找到目标值 %d\\n\", target)\r\n    }\r\n}', 200, '', '', '', '', '', 371, 0, '');
