INSERT INTO `submissions` VALUES (63, '2024-11-24 15:57:53.252', '2024-11-24 15:57:53.252', NULL, 1, 110, NULL, 'go', 'package main\r\n\r\nimport (\r\n    \"fmt\"\r\n)\r\n\r\n// 判断是否为闰年\r\nfunc isLeapYear(year int) bool {\r\n    if (year%4 == 0 && year%100!= 0) || year%400 == 0 {\r\n        return true\r\n    }\r\n    return false\r\n}\r\n\r\n// 计算是该年的第几天\r\nfunc dayOfYear(year, month, day int) int {\r\n    daysInMonth := []int{0, 31, 28, 30, 31, 30, 31, 31, 30, 31, 30, 31}\r\n\r\n    if isLeapYear(year) {\r\n        daysInMonth[2] = 29\r\n    }\r\n\r\n    totalDays := 0\r\n    for i := 1; i < month; i++ {\r\n        totalDays += daysInMonth[i]\r\n    }\r\n\r\n    totalDays += day\r\n\r\n    return totalDays\r\n}\r\n\r\nfunc main() {\r\n    var year, month, day int\r\n    fmt.Scanln(&year)\r\n    fmt.Scanln(&month)\r\n    fmt.Scanln(&year)\r\n\r\n    result := dayOfYear(year, month, day)\r\n    fmt.Println(result)\r\n}', 202, '', '1', '2025 1 1', '1', '0\n', 0, 0, NULL);
