INSERT INTO `submissions` VALUES (73, '2024-11-24 16:29:56.028', '2024-11-24 16:29:56.028', NULL, 1, 113, NULL, 'go', 'package main\r\n\r\nimport (\r\n    \"fmt\"\r\n)\r\n\r\nfunc main() {\r\n    var n int\r\n    fmt.Scanln(&n)\r\n\r\n    if n == 1 || n == 2 {\r\n        fmt.Println(1)\r\n    } else {\r\n        a, b := 1, 1\r\n        for i := 3; i <= n; i++ {\r\n            c := a + b\r\n            a, b = b, c\r\n        }\r\n        fmt.Println(b)\r\n    }\r\n}\r\n', 200, '', '', '', '', '', 639017621, 0, NULL);
INSERT INTO `submissions` VALUES (74, '2024-11-24 16:39:44.346', '2024-11-24 16:39:44.346', NULL, 1, 114, NULL, 'go', 'package main\r\n\r\nimport (\r\n    \"fmt\"\r\n    \"math\"\r\n)\r\n\r\nfunc main() {\r\n    var n int\r\n    fmt.Scanln(&n)\r\n\r\n    isPrime := make([]bool, n+1)\r\n    for i := range isPrime {\r\n        isPrime[i] = true\r\n    }\r\n    isPrime[0] = false\r\n    isPrime[1] = false\r\n\r\n    for i := 2; i <= int(math.Sqrt(float64(n))); i++ {\r\n        if isPrime[i] {\r\n            for j := i * i; j <= n; j += i {\r\n                isPrime[j] = false\r\n            }\r\n            }\r\n        }\r\n\r\n    for i := 2; i <= n; i++ {\r\n        if isPrime[i] {\r\n            fmt.Printf(\"%d \", i)\r\n        }\r\n    }\r\n}', 200, '', '', '', '', '', 350804446, 0, NULL);
INSERT INTO `submissions` VALUES (75, '2024-11-24 16:43:10.664', '2024-11-24 16:43:10.664', NULL, 1, 115, NULL, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\nfunc main() {\r\n    for num := 100; num < 1000; num++ {\r\n        hundreds := num / 100\r\n        tens := (num / 10) % 10\r\n        units := num % 10\r\n\r\n        if hundreds*hundreds*hundreds+tens*tens*tens+units*units*units == num {\r\n            fmt.Printf(\"%d \", num)\r\n        }\r\n    }\r\n}', 200, '', '', '', '', '', 2074403, 0, NULL);
INSERT INTO `submissions` VALUES (76, '2024-11-24 16:44:58.190', '2024-11-24 16:44:58.190', NULL, 1, 116, NULL, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\nfunc main() {\r\n    var n int\r\n    fmt.Scanln(&n)\r\n\r\n    fmt.Printf(\"%d=\", n)\r\n\r\n    // 从最小的质数2开始尝试分解\r\n    for i := 2; i <= n; i++ {\r\n        // 如果当前数能被i整除，且i是质数\r\n        for n%i == 0 && isPrime(i) {\r\n            n /= i\r\n            if n!= 1 {\r\n                fmt.Printf(\"%d*\", i)\r\n            } else {\r\n                fmt.Printf(\"%d\", i)\r\n            }\r\n            i = 1\r\n        }\r\n    }\r\n}\r\n\r\n// 判断一个数是否为质数\r\nfunc isPrime(num int) bool {\r\n    if num <= 1 {\r\n        return false\r\n    }\r\n    if num <= 3 {\r\n        return true\r\n    }\r\n    if num%2 == 0 || num%3 == 0 {\r\n        return false\r\n    }\r\n\r\n    i := 5\r\n    for i*i <= num {\r\n        if num%i == 0 || num%(i+2) == 0 {\r\n            return false\r\n        }\r\n        i += 6\r\n    }\r\n\r\n    return true\r\n}', 200, '', '', '', '', '', 658501848, 0, NULL);
INSERT INTO `submissions` VALUES (77, '2024-11-24 16:46:15.354', '2024-11-24 16:46:15.354', NULL, 1, 117, NULL, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\n// 求最大公约数（辗转相除法）\r\nfunc gcd(m, n int) int {\r\n    for n!= 0 {\r\n        m, n = n, m%n\r\n    }\r\n    return m\r\n}\r\n\r\n// 求最小公倍数\r\nfunc lcm(m, n int) int {\r\n    return m * n / gcd(m, n)\r\n}\r\n\r\nfunc main() {\r\n    var m, n int\r\n    fmt.Scanln(&m)\r\n    fmt.Scanln(&n)\r\n\r\n    fmt.Printf(\"%d %d\\n\", gcd(m, n), lcm(m, n))\r\n}', 202, '', '1', '12 18', '6 36', '4 24\n', 0, 0, NULL);
INSERT INTO `submissions` VALUES (78, '2024-11-24 16:47:31.038', '2024-11-24 16:47:31.038', NULL, 1, 117, NULL, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\nfunc gcd(x, y int) int {\r\n	tmp := x % y\r\n	if tmp > 0 {\r\n		return gcd(y, tmp)\r\n	} else {\r\n		return y\r\n	}\r\n}\r\n\r\n// 求最小公倍数\r\nfunc lcm(m, n int) int {\r\n    return m * n / gcd(m, n)\r\n}\r\n\r\nfunc main() {\r\n    var m, n int\r\n    fmt.Scanln(&m)\r\n    fmt.Scanln(&n)\r\n\r\n    fmt.Printf(\"%d %d\\n\", gcd(m, n), lcm(m, n))\r\n}', 202, '', '1', '12 18', '6 36', '4 24\n', 0, 0, NULL);
