INSERT INTO `submissions` VALUES (87, '2024-11-24 16:57:57.753', '2024-11-24 16:57:57.753', NULL, 1, 119, NULL, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\n// 链表节点结构体\r\ntype ListNode struct {\r\n    Val  int\r\n    Next *ListNode\r\n}\r\n\r\nfunc main() {\r\n    var n int\r\n    fmt.Scanln(&n)\r\n\r\n    // 创建初始链表，只有一个元素1\r\n    head := &ListNode{Val: 1}\r\n\r\n    for i := 0; i < n; i++ {\r\n        var op, x, y int\r\n        fmt.Scanln(&op, &x, &y)\r\n\r\n        switch op {\r\n        case 1:\r\n            insertNode(head, x, y)\r\n        case 2:\r\n            result := queryNext(head, x)\r\n            fmt.Println(result)\r\n        case 3:\r\n            deleteNext(head, x)\r\n        }\r\n    }\r\n}\r\n\r\n// 插入节点函数\r\nfunc insertNode(head *ListNode, x, y int) {\r\n    cur := head\r\n    for cur!= nil {\r\n        if cur.Val == x {\r\n            newNode := &ListNode{Val: y}\r\n            newNode.Next = cur.Next\r\n            cur.Next = newNode\r\n            break\r\n        }\r\n        cur = cur.Next\r\n    }\r\n}\r\n\r\n// 查询后继元素函数\r\nfunc queryNext(head *ListNode, x int) int {\r\n    cur := head\r\n    for cur!= nil {\r\n        if cur.Val == x {\r\n            if cur.Next == nil {\r\n                return 0\r\n            }\r\n            return cur.Next.Val\r\n        }\r\n        cur = cur.Next\r\n    }\r\n    return 0\r\n}\r\n\r\n// 删除后继元素函数\r\nfunc deleteNext(head *ListNode, x int) {\r\n    cur := head\r\n    for cur!= nil {\r\n        if cur.Val == x {\r\n            if cur.Next!= nil {\r\n                cur.Next = cur.Next.Next\r\n            }\r\n            break\r\n        }\r\n        cur = cur.Next\r\n    }\r\n}', 202, '', '4', '5\r\n1 1 2\r\n1 2 3\r\n2 1\r\n2 2\r\n3 2', '2\r\n3\r\n0', '2\n3\n', 0, 0, NULL);
INSERT INTO `submissions` VALUES (88, '2024-11-24 16:59:48.953', '2024-11-24 16:59:48.953', NULL, 1, 119, NULL, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\n// 链表节点结构体\r\ntype ListNode struct {\r\n    Val  int\r\n    Next *ListNode\r\n}\r\n\r\nfunc main() {\r\n    var n int\r\n    fmt.Scanln(&n)\r\n\r\n    // 创建初始链表，只有一个元素1\r\n    head := &ListNode{Val: 1}\r\n\r\n    for i := 0; i < n; i++ {\r\n        var op, x, y int\r\n        fmt.Scanln(&op, &x, &y)\r\n\r\n        switch op {\r\n        case 1:\r\n            insertNode(head, x, y)\r\n        case 2:\r\n            result := queryNext(head, x)\r\n            fmt.Println(result)\r\n        case 3:\r\n            deleteNext(head, x)\r\n        }\r\n    }\r\n}\r\n\r\n// 插入节点函数\r\nfunc insertNode(head *ListNode, x, y int) {\r\n    cur := head\r\n    for cur!= nil {\r\n        if cur.Val == x {\r\n            newNode := &ListNode{Val: y}\r\n            newNode.Next = cur.Next\r\n            cur.Next = newNode\r\n            break\r\n        }\r\n        cur = cur.Next\r\n    }\r\n}\r\n\r\n// 查询后继元素函数\r\nfunc queryNext(head *ListNode, x int) int {\r\n    cur := head\r\n    for cur!= nil {\r\n        if cur.Val == x {\r\n            if cur.Next == nil {\r\n                return 0\r\n            }\r\n            return cur.Next.Val\r\n        }\r\n        cur = cur.Next\r\n    }\r\n    return 0\r\n}\r\n\r\n// 删除后继元素函数\r\nfunc deleteNext(head *ListNode, x int) {\r\n    cur := head\r\n    for cur!= nil {\r\n        if cur.Val == x {\r\n            if cur.Next!= nil {\r\n                cur.Next = cur.Next.Next\r\n            }\r\n            break\r\n        }\r\n        cur = cur.Next\r\n    }\r\n}', 202, '', '5', '10\r\n1 1 2\r\n1 2 3\r\n1 3 4\r\n1 4 5\r\n2 1\r\n2 2\r\n2 3\r\n2 4\r\n3 3\r\n2 3', '2\r\n3\r\n4\r\n5\r\n0\r\n4', '2\n3\n4\n5\n5\n', 0, 0, NULL);
