INSERT INTO `submissions` VALUES (91, '2024-11-24 17:04:17.943', '2024-11-24 17:04:17.943', NULL, 1, 119, NULL, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\n// 链表节点结构体\r\ntype ListNode struct {\r\n    Val  int\r\n    Next *ListNode\r\n}\r\n\r\nfunc main() {\r\n    var n int\r\n    fmt.Scanln(&n)\r\n\r\n    // 创建初始链表，只有一个元素1\r\n    head := &ListNode{Val: 1}\r\n\r\n    for i := 0; i < n; i++ {\r\n        var op, x, y int\r\n        fmt.Scanln(&op, &x, &y)\r\n\r\n        switch op {\r\n        case 1:\r\n            insertNode(head, x, y)\r\n        case 2:\r\n            result := queryNext(head, x)\r\n            fmt.Println(result)\r\n        case 3:\r\n            deleteNext(head, x)\r\n        }\r\n    }\r\n}\r\n\r\n// 插入节点函数\r\nfunc insertNode(head *ListNode, x, y int) {\r\n    cur := head\r\n    for cur!= nil {\r\n        if cur.Val == x {\r\n            newNode := &ListNode{Val: y}\r\n            newNode.Next = cur.Next\r\n            cur.Next = newNode\r\n            break\r\n        }\r\n        cur = cur.Next\r\n    }\r\n}\r\n\r\n// 查询后继元素函数\r\nfunc queryNext(head *ListNode, x int) int {\r\n    cur := head\r\n    for cur!= nil {\r\n        if cur.Val == x {\r\n            if cur.Next == nil {\r\n                return 0\r\n            }\r\n            return cur.Next.Val\r\n        }\r\n        cur = cur.Next\r\n    }\r\n    return 0\r\n}\r\n\r\n// 删除后继元素函数\r\nfunc deleteNext(head *ListNode, x int) {\r\n    cur := head\r\n    for cur!= nil {\r\n        if cur.Val == x {\r\n            if cur.Next!= nil {\r\n                cur.Next = cur.Next.Next\r\n            }\r\n            break\r\n        }\r\n        cur = cur.Next\r\n    }\r\n}', 200, '', '', '', '', '', 1310969668, 0, NULL);
INSERT INTO `submissions` VALUES (92, '2024-11-24 17:05:05.176', '2024-11-24 17:05:05.176', NULL, 1, 120, NULL, 'go', 'package main\r\n\r\nimport (\r\n    \"fmt\"\r\n)\r\n\r\n// 链表节点结构体\r\ntype ListNode struct {\r\n    Val  int\r\n    Next *ListNode\r\n}\r\n\r\n// 反转链表函数\r\nfunc reverseList(pHead *ListNode) *ListNode {\r\n    var prev *ListNode\r\n    cur := pHead\r\n\r\n    for cur!= nil {\r\n        next := cur.Next\r\n        cur.Next = prev\r\n        prev = cur\r\n        cur = next\r\n    }\r\n\r\n    return prev\r\n}\r\n\r\nfunc main() {\r\n    var n int\r\n    fmt.Scanln(&n)\r\n\r\n    var head *ListNode\r\n    var tail *ListNode\r\n\r\n    for i := 0; i < n; i++ {\r\n        var val int\r\n        fmt.Scanln(&val)\r\n\r\n        newNode := &ListNode{Val: val}\r\n\r\n        if head == nil {\r\n            head = newNode\r\n            tail = newNode\r\n        } else {\r\n            tail.Next = newNode\r\n            tail = newNode\r\n        }\r\n    }\r\n\r\n    reversedHead := reverseList(head)\r\n\r\n    for reversedHead!= nil {\r\n        fmt.Printf(\"%d \", reversedHead.Val)\r\n        reversedHead = reversedHead.Next\r\n    }\r\n}\r\n', 202, '', '2', '2\r\n1 2', '1 2', '0 1 ', 0, 0, NULL);
