INSERT INTO `submissions` VALUES (96, '2024-11-24 17:08:05.266', '2024-11-24 17:08:05.266', NULL, 1, 121, NULL, 'go', 'package main\r\n\r\nimport (\r\n    \"fmt\"\r\n)\r\n\r\nfunc twoSum(nums []int, target int) []int {\r\n    for i, num1 := range nums {\r\n        for j, num2 := range nums {\r\n            if i!= j && num1+num2 == target {\r\n                return []int{i, j}\r\n            }\r\n        }\r\n    }\r\n    return []int{-1, -1}\r\n}\r\n\r\nfunc main() {\r\n    var n int\r\n    fmt.Scanln(&n)\r\n\r\n    nums := make([]int, n)\r\n    for i := 0; i < n; i++ {\r\n        fmt.Scanln(&nums[i])\r\n    }\r\n\r\n    var target int\r\n    fmt.Scanln(&target)\r\n\r\n    result := twoSum(nums, target)\r\n    fmt.Println(result[0], result[1])\r\n}', 202, '', '1', '2\r\n-1 1\r\n0', '0 1', '-1 -1\n', 0, 0, NULL);
