INSERT INTO `submissions` VALUES (104, '2024-11-24 17:19:16.888', '2024-11-24 17:19:16.888', NULL, 1, 122, NULL, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\nfunc lengthOfLongestSubstring(s string) int {\r\n    n := len(s)\r\n    maxLen := 0\r\n    left := 0\r\n    charMap := make(map[byte]int)\r\n\r\n    for right := 0; right < n; right++ {\r\n        if _, ok := charMap[s[right]]; ok {\r\n            left = max(left, charMap[s[right]]+1)\r\n        }\r\n        charMap[s[right]] = right\r\n        maxLen = max(maxLen, right-left+1)\r\n    }\r\n\r\n    return maxLen\r\n}\r\n\r\nfunc max(a, b int) int {\r\n    if a > b {\r\n        return a\r\n    }\r\n    return b\r\n}\r\n\r\nfunc main() {\r\n    var s string\r\n    fmt.Scanln(s)\r\n\r\n    result := lengthOfLongestSubstring(s)\r\n    fmt.Println(result)\r\n}', 202, '', '1', 'dvdf', '3', '0\n', 0, 0, NULL);
INSERT INTO `submissions` VALUES (105, '2024-11-24 17:19:47.881', '2024-11-24 17:19:47.881', NULL, 1, 122, NULL, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\nfunc lengthOfLongestSubstring(s string) int {\r\n    n := len(s)\r\n    maxLength := 0\r\n    left := 0\r\n    charSet := make(map[byte]bool)\r\n\r\n    for right := 0; right < n; right++ {\r\n        for charSet[s[right]] {\r\n            delete(charSet, s[left])\r\n            left++\r\n        }\r\n\r\n        charSet[s[right]] = true\r\n        currentLength := right - left + 1\r\n        if currentLength > maxLength {\r\n            maxLength = currentLength\r\n        }\r\n    }\r\n\r\n    return maxLength\r\n}\r\n\r\nfunc main() {\r\n    var s string\r\n    fmt.Scanln(s)\r\n\r\n    result := lengthOfLongestSubstring(s)\r\n    fmt.Println(result)\r\n}', 202, '', '1', 'dvdf', '3', '0\n', 0, 0, NULL);
INSERT INTO `submissions` VALUES (106, '2024-11-24 17:21:02.540', '2024-11-24 17:21:02.540', NULL, 1, 122, NULL, 'go', 'func lengthOfLongestSubstring(s string) int {\r\n    // guard clauses，也就是卫语句，在递归中非常重要\r\n    if len(s) <= 1 {\r\n        return len(s)\r\n    }\r\n    // 全局的字符串，用于保存\r\n    var mp = make(map[byte]int)\r\n    var i int\r\n    for i = 0 ;i < len(s); i++ {\r\n        if _, ok := mp[s[i]]; ok {\r\n            break // 找到重复的，直接退出\r\n        } else {\r\n            mp[s[i]] = i // 没找到重复的，加上这个子串\r\n        }\r\n    }\r\n\r\n    length := lengthOfLongestSubstring(s[1:])\r\n    if i > length {\r\n        return i\r\n    }\r\n    return length\r\n}', 203, '/main.go:1:1: expected \'package\', found \'func\'\n', '', '', '', '', 0, 0, NULL);
