INSERT INTO `submissions` VALUES (113, '2024-11-24 17:27:52.020', '2024-11-24 17:27:52.020', NULL, 1, 122, NULL, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\nfunc lengthOfLongestSubstring(s string) int {\r\n    // guard clauses，也就是卫语句，在递归中非常重要\r\n    if len(s) <= 1 {\r\n        return len(s)\r\n    }\r\n    // 全局的字符串，用于保存\r\n    var mp = make(map[byte]int)\r\n    var i int\r\n    for i = 0 ;i < len(s); i++ {\r\n        if _, ok := mp[s[i]]; ok {\r\n            break // 找到重复的，直接退出\r\n        } else {\r\n            mp[s[i]] = i // 没找到重复的，加上这个子串\r\n        }\r\n    }\r\n\r\n    length := lengthOfLongestSubstring(s[1:])\r\n    if i > length {\r\n        return i\r\n    }\r\n    return length\r\n}\r\n\r\nfunc main() {\r\n    var s string\r\n    fmt.Scan(&s)\r\n\r\n    result := lengthOfLongestSubstring(s)\r\n    fmt.Println(result)\r\n}', 200, '', '', '', '', '', 1399954832, 0, NULL);
INSERT INTO `submissions` VALUES (114, '2024-11-24 18:10:45.593', '2024-11-24 18:10:45.593', NULL, 1, 123, NULL, 'go', 'package main\r\n\r\nimport (\r\n    \"fmt\"\r\n)\r\n\r\nfunc longestPalindrome(s string) string {\r\n    n := len(s)\r\n    if n < 2 {\r\n        return s\r\n    }\r\n\r\n    maxLen := 1\r\n    begin := 0\r\n\r\n    // 中心扩展法\r\n    for i := 0; i < n; i++ {\r\n        oddLen := expandAroundCenter(s, i, i)\r\n        evenLen := expandAroundCenter(s, i, i+1)\r\n        curLen := max(oddLen, evenLen)\r\n\r\n        if curLen > maxLen {\r\n            maxLen = curLen\r\n            begin = i - (curLen-1)/2\r\n        }\r\n    }\r\n\r\n    return s[begin : begin+maxLen]\r\n}\r\n\r\nfunc expandAroundCenter(s string, left, right int) int {\r\n    L, R := left, right\r\n    n := len(s)\r\n\r\n    for L >= 0 && R < n && s[L] == s[R] {\r\n        L--\r\n        R++\r\n    }\r\n\r\n    return R - L - 1\r\n}\r\n\r\nfunc max(a, b int) int {\r\n    if a > b {\r\n        return a\r\n    }\r\n    return b\r\n}\r\n\r\nfunc main() {\r\n    var s string\r\n    fmt.Scan(s)\r\n\r\n    result := longestPalindrome(s)\r\n    fmt.Println(result)\r\n}', 202, '', '1', 'babad', 'bab', '\n', 0, 0, NULL);
INSERT INTO `submissions` VALUES (115, '2024-11-24 18:11:13.994', '2024-11-24 18:11:13.994', NULL, 1, 123, NULL, 'go', 'package main\r\n\r\nimport (\r\n    \"fmt\"\r\n)\r\n\r\nfunc longestPalindrome(s string) string {\r\n    n := len(s)\r\n    if n < 2 {\r\n        return s\r\n    }\r\n\r\n    maxLen := 1\r\n    begin := 0\r\n\r\n    // 中心扩展法\r\n    for i := 0; i < n; i++ {\r\n        oddLen := expandAroundCenter(s, i, i)\r\n        evenLen := expandAroundCenter(s, i, i+1)\r\n        curLen := max(oddLen, evenLen)\r\n\r\n        if curLen > maxLen {\r\n            maxLen = curLen\r\n            begin = i - (curLen-1)/2\r\n        }\r\n    }\r\n\r\n    return s[begin : begin+maxLen]\r\n}\r\n\r\nfunc expandAroundCenter(s string, left, right int) int {\r\n    L, R := left, right\r\n    n := len(s)\r\n\r\n    for L >= 0 && R < n && s[L] == s[R] {\r\n        L--\r\n        R++\r\n    }\r\n\r\n    return R - L - 1\r\n}\r\n\r\nfunc max(a, b int) int {\r\n    if a > b {\r\n        return a\r\n    }\r\n    return b\r\n}\r\n\r\nfunc main() {\r\n    var s string\r\n    fmt.Scan(&s)\r\n\r\n    result := longestPalindrome(s)\r\n    fmt.Println(result)\r\n}', 200, '', '', '', '', '', 19962139, 0, NULL);
INSERT INTO `submissions` VALUES (116, '2024-11-24 18:11:42.150', '2024-11-24 18:11:42.150', NULL, 1, 124, NULL, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\nfunc convert(s string, numRows int) string {\r\n    if numRows == 1 {\r\n        return s\r\n    }\r\n\r\n    rows := make([]string, numRows)\r\n    curRow := 0\r\n    goingDown := false\r\n\r\n    for _, char := range s {\r\n        rows[curRow] += string(char)\r\n\r\n        if curRow == 0 || curRow == numRows-1 {\r\n            goingDown =!goingDown\r\n        }\r\n\r\n        if goingDown {\r\n            curRow++\r\n        } else {\r\n            curRow--\r\n        }\r\n    }\r\n\r\n    var result string\r\n    for _, row := range rows {\r\n        result += row\r\n    }\r\n\r\n    return result\r\n}\r\n\r\nfunc main() {\r\n    var s string\r\n    fmt.Scan(&s)\r\n\r\n    var numRows int\r\n    fmt.Scan(&numRows)\r\n\r\n    output := convert(s, numRows)\r\n    fmt.Println(output)\r\n}', 202, '', '5', 'THISISALONGLONGSTRING\r\n5', 'TIIGSIHOLNLSRINGGOT', 'TOTHLNSRIAGGISSLNNIOG\n', 0, 0, NULL);
INSERT INTO `submissions` VALUES (117, '2024-11-24 18:12:46.324', '2024-11-24 18:12:46.324', NULL, 1, 124, NULL, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\nfunc convert(s string, numRows int) string {\r\n    // 很巧妙 头尾转变方向\r\n    arr := make([]string, numRows)\r\n    if numRows < 2 {\r\n        return s\r\n    }\r\n\r\n    i, flag := 0, -1\r\n    for _, v := range s {\r\n        arr[i] += string(v)\r\n        if i == 0 || i == numRows -1 {\r\n            flag = -flag\r\n        }\r\n        i += flag\r\n    }\r\n\r\n    var result string\r\n    fmt.Println(arr, result)\r\n\r\n    for i := 0; i < len(arr); i++ {\r\n        result += arr[i]\r\n    }\r\n\r\n    return result\r\n}\r\n\r\n\r\nfunc main() {\r\n    var s string\r\n    fmt.Scan(&s)\r\n\r\n    var numRows int\r\n    fmt.Scan(&numRows)\r\n\r\n    output := convert(s, numRows)\r\n    fmt.Println(output)\r\n}', 202, '', '1', 'PAYPALISHIRING\r\n3', 'PAHNAPLSIIGYIR', '[PAHN APLSIIG YIR] \nPAHNAPLSIIGYIR\n', 0, 0, NULL);
