INSERT INTO `submissions` VALUES (120, '2024-11-24 18:16:46.398', '2024-11-24 18:16:46.398', NULL, 1, 125, NULL, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\n// reverse函数用于反转一个32位有符号整数\r\nfunc reverse(x int) int {\r\n    // 定义32位有符号整数的最小值和最大值\r\n    const INT_MIN = -1 << 31\r\n    const INT_MAX = 1<<31 - 1\r\n\r\n    // 用于存储反转后的整数\r\n    var reversed int\r\n\r\n    // 根据输入整数的正负确定符号\r\n    sign := 1\r\n    if x < 0 {\r\n        sign = -1\r\n        x = -x\r\n    }\r\n\r\n    // 循环进行数字反转操作\r\n    for x!= 0 {\r\n        // 取出当前整数的最后一位数字\r\n        lastDigit := x % 10\r\n\r\n        // 检查是否会发生溢出\r\n        if reversed > INT_MAX/10 || (reversed == INT_MAX/10 && lastDigit > INT_MAX%10) {\r\n            return 0\r\n        }\r\n        if reversed < INT_MIN/10 || (reversed == INT_MIN/10 && lastDigit < INT_MIN%10) {\r\n            return 0\r\n        }\r\n\r\n        // 将取出的数字添加到反转后的整数中\r\n        reversed = reversed*10 + lastDigit\r\n\r\n        // 更新原整数，去掉已经处理过的最后一位数字\r\n        x /= 10\r\n    }\r\n\r\n    // 返回反转后的整数，并根据原整数的符号进行调整\r\n    return reversed * sign\r\n}\r\n\r\nfunc main() {\r\n    // 示例输入\r\n    num := 0\r\n    fmt.Scan(&num)\r\n    num = reverse(num)\r\n    fmt.Println(num)\r\n}', 202, '', '1', '123', '-123', '321\n', 0, 0, NULL);
