INSERT INTO `submissions` VALUES (124, '2024-11-24 18:20:59.754', '2024-11-24 18:20:59.754', NULL, 1, 126, NULL, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\n// isPalindrome函数用于判断一个整数是否为回文整数\r\nfunc isPalindrome(a int) bool {\r\n    if a < 0 {\r\n        return false\r\n    }\r\n\r\n    // 将整数转换为字符串\r\n    numStr := fmt.Sprintf(\"%d\", a)\r\n\r\n    // 遍历字符串的前半部分和后半部分进行比较\r\n    for i := 0; i < len(numStr)/2; i++ {\r\n        if numStr[i]!= numStr[len(numStr)-1-i] {\r\n            return false\r\n        }\r\n    }\r\n\r\n    return true\r\n}\r\n\r\nfunc main() {\r\n    // 示例输入\r\n    num := 0\r\n    fmt.Scan(&num)\r\n    a := isPalindrome(num)\r\n    fmt.Println(a)\r\n}', 200, '', '', '', '', '', 18475420, 0, NULL);
INSERT INTO `submissions` VALUES (125, '2024-11-24 18:22:38.422', '2024-11-24 18:22:38.422', NULL, 1, 127, NULL, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\n// maxArea函数用于找出给定数组中两条垂线与x轴构成容器能容纳的最大水量\r\nfunc maxArea(height []int) int {\r\n    left, right := 0, len(height)-1\r\n    maxWater := 0\r\n\r\n    for left < right {\r\n        // 计算当前两条垂线构成容器的水量\r\n        currentArea := min(height[left], height[right]) * (right - left)\r\n        // 更新最大水量\r\n        if currentArea > maxWater {\r\n            maxWater = currentArea\r\n        }\r\n\r\n        // 根据垂线高度调整指针\r\n        if height[left] < height[right] {\r\n            left++\r\n        } else {\r\n            right--\r\n        }\r\n    }\r\n\r\n    return maxWater\r\n}\r\n\r\n// min函数用于返回两个整数中的较小值\r\nfunc min(a, b int) int {\r\n    if a < b {\r\n        return a\r\n    }\r\n    return b\r\n}\r\n\r\nfunc main() {\r\n    n := 0\r\n    nums := make([]int, n)\r\n    for i := 0; i < n; i++ {\r\n        fmt.Scan(&nums[i])\r\n    }\r\n    answer := maxArea(nums)\r\n    fmt.Println(answer)\r\n}', 202, '', '1', '9\r\n1 8 6 2 5 4 8 3 7', '49', '0\n', 0, 0, NULL);
