INSERT INTO `submissions` VALUES (128, '2024-11-24 18:25:52.919', '2024-11-24 18:25:52.919', NULL, 1, 127, NULL, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\n// maxArea函数用于找出给定数组中两条垂线与x轴构成容器能容纳的最大水量\r\nfunc maxArea(height []int) int {\r\n    left, right := 0, len(height)-1\r\n    maxWater := 0\r\n\r\n    for left < right {\r\n        // 计算当前两条垂线构成容器的水量\r\n        currentArea := min(height[left], height[right]) * (right - left)\r\n        // 更新最大水量\r\n        if currentArea > maxWater {\r\n            maxWater = currentArea\r\n        }\r\n\r\n        // 根据垂线高度调整指针\r\n        if height[left] < height[right] {\r\n            left++\r\n        } else {\r\n            right--\r\n        }\r\n    }\r\n\r\n    return maxWater\r\n}\r\n\r\n// min函数用于返回两个整数中的较小值\r\nfunc min(a, b int) int {\r\n    if a < b {\r\n        return a\r\n    }\r\n    return b\r\n}\r\n\r\nfunc main() {\r\n    n := 0\r\n    fmt.Scan(&n)\r\n    nums := make([]int, n)\r\n    for i := 0; i < n; i++ {\r\n        fmt.Scan(&nums[i])\r\n    }\r\n    answer := maxArea(nums)\r\n    fmt.Println(answer)\r\n}', 200, '', '', '', '', '', 9454960, 0, NULL);
INSERT INTO `submissions` VALUES (129, '2024-11-24 18:26:58.559', '2024-11-24 18:26:58.559', NULL, 1, 128, NULL, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\n// climbStairs函数用于计算爬到指定台阶数的不同方法数\r\nfunc climbStairs(n int) int {\r\n    if n == 1 {\r\n        return 1\r\n    }\r\n\r\n    a, b := 1, 2\r\n    for i := 2; i < n; i++ {\r\n        c := a + b\r\n        a = b\r\n        b = c\r\n    }\r\n\r\n    return b\r\n}\r\n\r\nfunc main() {\r\n    num := 0\r\n    fmt.Scan(&num)\r\n    answer := climbStairs(num)\r\n    fmt.Println(answer)\r\n}', 200, '', '', '', '', '', 13360962, 0, NULL);
INSERT INTO `submissions` VALUES (130, '2024-11-24 18:28:20.774', '2024-11-24 18:28:20.774', NULL, 1, 129, NULL, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\n// addBinary函数用于计算两个二进制字符串的和，并以二进制字符串形式返回结果\r\nfunc addBinary(a, b string) string {\r\n    // 将二进制字符串转换为整数\r\n    num1, err1 := strconv.ParseInt(a, 2, 64)\r\n    num2, err2 := strconv.ParseInt(b, 2, 64)\r\n\r\n    if err1!= nil || err2!= nil {\r\n        fmt.Println(\"输入的二进制字符串转换错误\")\r\n        return \"\"\r\n    }\r\n\r\n    // 计算两数之和\r\n    sum := num1 + num2\r\n\r\n    // 将和转换为二进制字符串\r\n    return strconv.FormatInt(sum, 2)\r\n}\r\n\r\nfunc main() {\r\n    a := \"\"\r\n    b := \"\"\r\n    fmt.Scan(&a)\r\n    fmt.Scan(&b)\r\n    result := addBinary(a, b)\r\n    fmt.Println(result)\r\n}\r\n', 203, '# command-line-arguments\n/main.go:8:19: undefined: strconv\n/main.go:9:19: undefined: strconv\n/main.go:20:12: undefined: strconv\n', '', '', '', '', 0, 0, NULL);
