INSERT INTO `submissions` VALUES (135, '2024-11-25 01:55:17.119', '2024-11-25 01:55:17.119', NULL, 24, 130, NULL, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\n\r\nfunc binarySearch(nums []int, target int) int {\r\n    left, right := 0, len(nums)-1\r\n\r\n    for left <= right {\r\n        mid := left + (right-left)/2\r\n\r\n        if nums[mid] == target {\r\n            return mid\r\n        } else if nums[mid] < target {\r\n            left = mid + 1\r\n        } else {\r\n            right = mid - 1\r\n        }\r\n    }\r\n\r\n    return -1\r\n}\r\nfunc main() {\r\n    nums := []int{1, 3, 5, 7, 9, 11, 13}\r\n    target := 7\r\n    result := binarySearch(nums, target)\r\n    if result!= -1 {\r\n        fmt.Printf(\"目标值 %d 在数组中的索引为 %d\\n\", target, result)\r\n    } else {\r\n        fmt.Printf(\"数组中未找到目标值 %d\\n\", target)\r\n    }\r\n}', 200, '', '', '', '', '', 150, 0, NULL);
