INSERT INTO `submissions` VALUES (166, '2024-11-26 20:25:48.188', '2024-11-26 20:25:48.188', NULL, 27, 130, NULL, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\n\r\nfunc binarySearch(nums []int, target int) int {\r\n    left, right := 0, len(nums)-1\r\n	haha := 123\r\n	ha := 1\r\n    for left <= right {\r\n        mid := left + (right-left)/2\r\n\r\n        if nums[mid] == target {\r\n            return mid\r\n        } else if nums[mid] < target {\r\n            left = mid + 1\r\n        } else {\r\n            right = mid - 1\r\n        }\r\n    }\r\n\r\n    return -1+haha+ha\r\n}\r\nfunc main() {\r\n    nums := []int{1, 3, 5, 7, 9, 11, 13}\r\n    target := 7\r\n    result := binarySearch(nums, target)\r\n    if result!= -1 {\r\n        fmt.Printf(\"目标值 %d 在数组中的索引为 %d\\n\", target, result)\r\n    } else {\r\n        fmt.Printf(\"数组中未找到目标值 %d\\n\", target)\r\n    }\r\n}', 200, '', '', '', '', '', 382, 0, NULL);
