INSERT INTO `submissions` VALUES (172, '2024-12-25 23:44:54.085', '2024-12-26 00:46:27.299', NULL, 1, 130, NULL, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\n\r\n\r\nfunc binarySearch(nums []int, target int) int {\r\n    left, right := 0, len(nums)-1\r\n\r\n    for left <= right {\r\n        mid := left + (right-left)/2\r\n        if nums[mid] == target {\r\n            return mid\r\n        } else if nums[mid] < target {\r\n            left = mid + 1\r\n        } else {\r\n            right = mid - 1\r\n        }\r\n    }\r\n\r\n    return -1\r\n}\r\n\r\nfunc main() {\r\n    nums := []int{1, 3, 5, 7, 9, 11, 13}\r\n    target := 9\r\n    result := binarySearch(nums, target)\r\n    if result!= -1 {\r\n        fmt.Printf(\"目标值 %d 在数组中的索引为 %d\\n\", target, result)\r\n    } else {\r\n        fmt.Printf(\"数组中未找到目标值 %d\\n\", target)\r\n    }\r\n}', 200, '', '', '', '', '', 391, 0, '二分查找');
INSERT INTO `submissions` VALUES (173, '2024-12-26 00:45:34.275', '2024-12-26 00:45:54.776', NULL, 1, 130, NULL, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\n\r\n// https://leetcode.cn/problems/find-first-and-last-position-of-element-in-sorted-array/description/?envType=problem-list-v2&envId=binary-search\r\nfunc main() {\r\n    nums := []int{5,7,7,8,8,8,10}\r\n    target := 8\r\n    l := findFirst(nums, target)\r\n	r := findLast(nums, target)\r\n    fmt.Printf(\"%d %d\", l, r)\r\n}\r\n\r\nfunc findFirst(nums []int, target int) int {\r\n	left := 0\r\n	right := len(nums) - 1\r\n	for left < right {\r\n		mid := (left + right) / 2\r\n		if nums[mid] < target {\r\n			left = mid + 1\r\n		} else {\r\n			right = mid\r\n		}\r\n	}\r\n	if nums[left] == target {\r\n		return left\r\n	} else {\r\n		return -1\r\n	}\r\n}\r\n\r\nfunc findLast(nums []int, target int) int {\r\n	left := 0\r\n	right := len(nums) - 1\r\n	for left < right {\r\n		mid := (left + right + 1) / 2\r\n		if nums[mid] > target {\r\n			right = mid - 1\r\n		} else {\r\n			left = mid\r\n		}\r\n	}\r\n	if nums[left] == target {\r\n		return left\r\n	} else {\r\n		return -1\r\n	}\r\n}', 200, '', '', '', '', '', 190, 0, '在排序数组中查找元素的第一个和最后一个位置');
INSERT INTO `submissions` VALUES (174, '2024-12-26 23:07:20.709', '2024-12-26 23:07:27.530', NULL, 1, 130, NULL, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\n\r\n// https://leetcode.cn/problems/find-first-and-last-position-of-element-in-sorted-array/description/?envType=problem-list-v2&envId=binary-search\r\nfunc main() {\r\n    nums := []int{4,5,6,7,0,1,2}\r\n    l := find(nums)\r\n    fmt.Printf(\"%d\", l)\r\n}\r\n\r\nfunc find(nums []int) int {\r\n	left := 0\r\n    right := len(nums) - 1\r\n    for left < right {\r\n        mid := (left + right) / 2\r\n        if nums[mid] > nums[right] {\r\n            left = mid + 1\r\n        } else {\r\n            right = mid\r\n        }\r\n    }\r\n    return left\r\n}', 200, '', '', '', '', '', 290, 0, '寻找旋转排序数组中的最小值');
INSERT INTO `submissions` VALUES (175, '2024-12-29 17:11:47.507', '2024-12-29 17:12:03.298', NULL, 1, 131, NULL, 'go', 'package main\r\n\r\nimport (\r\n	\"fmt\"\r\n)\r\n\r\ntype LinkNode struct {\r\n    Val int\r\n    Next *LinkNode\r\n    Prev *LinkNode\r\n}\r\n\r\nfunc main() {\r\n	nums := []int{1, 2, 3, 4}\r\n    header := buildLink(nums)\r\n    node := header\r\n    for node != nil {\r\n        fmt.Println(node.Val)\r\n        node = node.Next\r\n    }\r\n}\r\n\r\nfunc buildLink(nums []int) *LinkNode {\r\n    var header, tail *LinkNode\r\n    for num := range nums {\r\n        node := &LinkNode{Val:num}\r\n        if header == nil {\r\n            header = node\r\n            tail = node\r\n        } else {\r\n            tail.Next = node\r\n            node.Prev = tail\r\n            tail = tail.Next\r\n        }\r\n    }\r\n    return header\r\n}\r\n', 200, '', '', '', '', '', 159, 0, '构建链表');
