INSERT INTO `user_codes` VALUES (10, '2024-09-17 01:11:29.160', '2024-11-16 21:13:07.279', NULL, 91, 1, 'go', 'package main\r\n\r\nimport (\r\n    \"fmt\"\r\n)\r\n\r\n\r\ntype MyStruct struct {\r\n    Field1 int\r\n    Field2 string\r\n}\r\n\r\nfunc main() {\r\n    // 整数变量\r\n    var intVar int = 42\r\n    // 字符串变量\r\n    var stringVar string = \"Hello, World!\"\r\n    // 数组变量\r\n    arrayVar := [3]int{1, 2, 3}\r\n    // 结构体变量\r\n    var structVar MyStruct = MyStruct{Field1: 10, Field2: \"Struct Value\"}\r\n    // 整数指针变量\r\n    var intPtr *int = &intVar\r\n    // 字符串指针变量\r\n    var stringPtr *string = &stringVar\r\n    // 结构体指针变量\r\n    var structPtr *MyStruct = &structVar\r\n    // 切片变量\r\n    sliceVar := []int{4, 5, 6}\r\n    // map 变量\r\n    var mapVar map[string]int = map[string]int{\"one\": 1, \"two\": 2}\r\n\r\n    fmt.Printf(\"%v\\n\", intVar)\r\n    fmt.Printf(\"%v\\n\", stringVar)\r\n    fmt.Printf(\"%v\\n\", arrayVar)\r\n    fmt.Printf(\"%v\\n\", structVar)\r\n    fmt.Printf(\"%v\\n\", intPtr)\r\n    fmt.Printf(\"%v\\n\", stringPtr)\r\n    fmt.Printf(\"%v\\n\", structPtr)\r\n    fmt.Printf(\"%v\\n\", sliceVar)\r\n    fmt.Printf(\"%v\\n\", mapVar)\r\n}\r\n', NULL);
