INSERT INTO `user_codes` VALUES (17, '2024-11-08 00:12:44.612', '2024-11-24 14:40:53.257', NULL, 98, 1, 'go', 'package main\r\n\r\nimport (\r\n	\"fmt\"\r\n)\r\n\r\nfunc main() {\r\n    arr := []int{1,2,4,5,6,7,8,9}\r\n    answer := find(arr, 5)\r\n    fmt.Println(answer)\r\n}\r\n\r\nfunc find(array []int, a int) int {\r\n    left := 0\r\n    right := len(array) - 1\r\n    for left < right {\r\n        mid := (left + right) / 2\r\n        if array[mid] >= a {\r\n            right = mid\r\n        } else {\r\n            left = mid\r\n        }\r\n    }\r\n    return array[left]\r\n}\r\n', NULL);
