INSERT INTO `user_codes` VALUES (19, '2024-11-16 11:12:03.286', '2024-11-24 14:19:06.376', NULL, 99, 1, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\n// 双向链表节点结构体\r\ntype ListNode struct {\r\n    value int\r\n    prev  *ListNode\r\n    next  *ListNode\r\n}\r\n\r\nfunc main() {\r\n    arr := []int{1, 2, 3, 4, 5}\r\n    var header, tail *ListNode\r\n    for _, v := range arr {\r\n        node := &ListNode{value: v}\r\n        if header == nil {\r\n            header = node\r\n            tail = node\r\n        } else {\r\n            tail.next = node\r\n            node.prev = tail\r\n            tail = tail.next\r\n        }\r\n    }\r\n    // 打印链表\r\n    node := header\r\n    for node != nil {\r\n        fmt.Println(node.value)\r\n        node = node.next\r\n    }\r\n}\r\n', NULL);
