INSERT INTO `user_codes` VALUES (40, '2024-11-19 00:17:35.613', '2024-11-26 00:28:14.215', NULL, 120, 1, 'go', 'package main\r\n\r\nimport (\r\n    \"fmt\"\r\n)\r\n\r\n// 链表节点结构体\r\ntype ListNode struct {\r\n    Val  int\r\n    Next *ListNode\r\n}\r\n\r\n// 反转链表函数\r\nfunc reverseList(pHead *ListNode) *ListNode {\r\n    var prev *ListNode\r\n    cur := pHead\r\n\r\n    for cur!= nil {\r\n        next := cur.Next\r\n        cur.Next = prev\r\n        prev = cur\r\n        cur = next\r\n    }\r\n\r\n    return prev\r\n}\r\n\r\nfunc main() {\r\n    var n int\r\n    fmt.Scan(&n)\r\n\r\n    var head *ListNode\r\n    var tail *ListNode\r\n\r\n    for i := 0; i < n; i++ {\r\n        var val int\r\n        fmt.Scan(&val)\r\n\r\n        newNode := &ListNode{Val: val}\r\n\r\n        if head == nil {\r\n            head = newNode\r\n            tail = newNode\r\n        } else {\r\n            tail.Next = newNode\r\n            tail = newNode\r\n        }\r\n    }\r\n\r\n    reversedHead := reverseList(head)\r\n\r\n    for reversedHead!= nil {\r\n        fmt.Printf(\"%d \", reversedHead.Val)\r\n        reversedHead = reversedHead.Next\r\n    }\r\n}\r\n', NULL);
