INSERT INTO `user_codes` VALUES (43, '2024-11-19 00:22:24.089', '2024-12-27 22:12:47.206', NULL, 119, 1, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\n// 链表节点结构体\r\ntype ListNode struct {\r\n    Val  int\r\n    Next *ListNode\r\n}\r\n\r\nfunc main() {\r\n    var n int\r\n    fmt.Scanln(&n)\r\n\r\n    // 创建初始链表，只有一个元素1\r\n    head := &ListNode{Val: 1}\r\n\r\n    for i := 0; i < n; i++ {\r\n        var op, x, y int\r\n        fmt.Scanln(&op, &x, &y)\r\n\r\n        switch op {\r\n        case 1:\r\n            insertNode(head, x, y)\r\n        case 2:\r\n            result := queryNext(head, x)\r\n            fmt.Println(result)\r\n        case 3:\r\n            deleteNext(head, x)\r\n        }\r\n    }\r\n}\r\n\r\n// 插入节点函数\r\nfunc insertNode(head *ListNode, x, y int) {\r\n    cur := head\r\n    for cur!= nil {\r\n        if cur.Val == x {\r\n            newNode := &ListNode{Val: y}\r\n            newNode.Next = cur.Next\r\n            cur.Next = newNode\r\n            break\r\n        }\r\n        cur = cur.Next\r\n    }\r\n}\r\n\r\n// 查询后继元素函数\r\nfunc queryNext(head *ListNode, x int) int {\r\n    cur := head\r\n    for cur!= nil {\r\n        if cur.Val == x {\r\n            if cur.Next == nil {\r\n                return 0\r\n            }\r\n            return cur.Next.Val\r\n        }\r\n        cur = cur.Next\r\n    }\r\n    return 0\r\n}\r\n\r\n// 删除后继元素函数\r\nfunc deleteNext(head *ListNode, x int) {\r\n    cur := head\r\n    for cur!= nil {\r\n        if cur.Val == x {\r\n            if cur.Next!= nil {\r\n                cur.Next = cur.Next.Next\r\n            }\r\n            break\r\n        }\r\n        cur = cur.Next\r\n    }\r\n}', NULL);
