INSERT INTO `user_codes` VALUES (48, '2024-11-24 14:40:44.451', '2025-01-01 23:21:36.252', NULL, 131, 1, 'go', 'package main\r\n\r\nimport (\r\n	\"fmt\"\r\n)\r\n\r\ntype LinkNode struct {\r\n    Val int\r\n    Next *LinkNode\r\n    Prev *LinkNode\r\n}\r\n\r\nfunc main() {\r\n	nums := []int{1, 2, 3, 4}\r\n    header := buildLink(nums)\r\n    node := header\r\n    for node != nil {\r\n        fmt.Println(node.Val)\r\n        node = node.Next\r\n    }\r\n}\r\n\r\nfunc buildLink(nums []int) *LinkNode {\r\n    var header, tail *LinkNode\r\n    for num := range nums {\r\n        node := &LinkNode{Val:num}\r\n        if header == nil {\r\n            header = node\r\n            tail = node\r\n        } else {\r\n            tail.Next = node\r\n            node.Prev = tail\r\n            tail = tail.Next\r\n        }\r\n    }\r\n    return header\r\n}\r\n', NULL);
