INSERT INTO `user_codes` VALUES (59, '2024-11-24 16:30:35.917', '2024-11-24 16:40:29.011', NULL, 114, 1, 'go', 'package main\r\n\r\nimport (\r\n    \"fmt\"\r\n    \"math\"\r\n)\r\n\r\nfunc main() {\r\n    var n int\r\n    fmt.Scanln(&n)\r\n\r\n    isPrime := make([]bool, n+1)\r\n    for i := range isPrime {\r\n        isPrime[i] = true\r\n    }\r\n    isPrime[0] = false\r\n    isPrime[1] = false\r\n\r\n    for i := 2; i <= int(math.Sqrt(float64(n))); i++ {\r\n        if isPrime[i] {\r\n            for j := i * i; j <= n; j += i {\r\n                isPrime[j] = false\r\n            }\r\n            }\r\n        }\r\n\r\n    for i := 2; i <= n; i++ {\r\n        if isPrime[i] {\r\n            fmt.Printf(\"%d \", i)\r\n        }\r\n    }\r\n}', NULL);
INSERT INTO `user_codes` VALUES (60, '2024-11-24 16:39:57.698', '2024-11-24 16:43:07.463', NULL, 115, 1, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\nfunc main() {\r\n    for num := 100; num < 1000; num++ {\r\n        hundreds := num / 100\r\n        tens := (num / 10) % 10\r\n        units := num % 10\r\n\r\n        if hundreds*hundreds*hundreds+tens*tens*tens+units*units*units == num {\r\n            fmt.Printf(\"%d \", num)\r\n        }\r\n    }\r\n}', NULL);
INSERT INTO `user_codes` VALUES (61, '2024-11-24 16:44:50.100', '2024-11-24 16:44:53.352', NULL, 116, 1, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\nfunc main() {\r\n    var n int\r\n    fmt.Scanln(&n)\r\n\r\n    fmt.Printf(\"%d=\", n)\r\n\r\n    // 从最小的质数2开始尝试分解\r\n    for i := 2; i <= n; i++ {\r\n        // 如果当前数能被i整除，且i是质数\r\n        for n%i == 0 && isPrime(i) {\r\n            n /= i\r\n            if n!= 1 {\r\n                fmt.Printf(\"%d*\", i)\r\n            } else {\r\n                fmt.Printf(\"%d\", i)\r\n            }\r\n            i = 1\r\n        }\r\n    }\r\n}\r\n\r\n// 判断一个数是否为质数\r\nfunc isPrime(num int) bool {\r\n    if num <= 1 {\r\n        return false\r\n    }\r\n    if num <= 3 {\r\n        return true\r\n    }\r\n    if num%2 == 0 || num%3 == 0 {\r\n        return false\r\n    }\r\n\r\n    i := 5\r\n    for i*i <= num {\r\n        if num%i == 0 || num%(i+2) == 0 {\r\n            return false\r\n        }\r\n        i += 6\r\n    }\r\n\r\n    return true\r\n}', NULL);
INSERT INTO `user_codes` VALUES (62, '2024-11-24 16:45:46.199', '2024-11-24 16:54:00.997', NULL, 117, 1, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\nfunc gcd(x, y int) int {\r\n	tmp := x % y\r\n	if tmp > 0 {\r\n		return gcd(y, tmp)\r\n	} else {\r\n		return y\r\n	}\r\n}\r\n\r\n// 求最小公倍数\r\nfunc lcm(m, n int) int {\r\n	return m * n / gcd(m, n)\r\n}\r\n\r\nfunc main() {\r\n	var m, n int\r\n	fmt.Scan(&m)\r\n	fmt.Scan(&n)\r\n	fmt.Printf(\"%d %d\\n\", gcd(m, n), lcm(m, n))\r\n}', NULL);
INSERT INTO `user_codes` VALUES (63, '2024-11-24 16:54:47.123', '2024-11-24 16:56:13.268', NULL, 118, 1, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\nfunc main() {\r\n    num := 1\r\n    for i := 9; i >= 1; i-- {\r\n        num = (num + 1) * 2\r\n    }\r\n    fmt.Println(num)\r\n}', NULL);
INSERT INTO `user_codes` VALUES (64, '2024-11-24 17:06:24.867', '2024-12-18 00:47:13.832', NULL, 121, 1, 'go', 'package main\r\n\r\nimport (\r\n    \"fmt\"\r\n)\r\n\r\nfunc twoSum(nums []int, target int) []int {\r\n    for i, num1 := range nums {\r\n        for j, num2 := range nums {\r\n            if i != j && num1 + num2 == target {\r\n                return []int{i, j}\r\n            }\r\n        }\r\n    }\r\n    return []int{-1, -1}\r\n}\r\n\r\nfunc main() {\r\n    var n int\r\n    fmt.Scan(&n)\r\n\r\n    nums := make([]int, n)\r\n    for i := 0; i < n; i++ {\r\n        fmt.Scan(&nums[i])\r\n    }\r\n\r\n    var target int\r\n    fmt.Scan(&target)\r\n\r\n    result := twoSum(nums, target)\r\n    fmt.Println(result[0], result[1])\r\n}', NULL);
INSERT INTO `user_codes` VALUES (65, '2024-11-24 17:17:55.412', '2024-11-24 17:22:09.050', NULL, 122, 1, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\nfunc lengthOfLongestSubstring(s string) int {\r\n    // guard clauses，也就是卫语句，在递归中非常重要\r\n    if len(s) <= 1 {\r\n        return len(s)\r\n    }\r\n    // 全局的字符串，用于保存\r\n    var mp = make(map[byte]int)\r\n    var i int\r\n    for i = 0 ;i < len(s); i++ {\r\n        if _, ok := mp[s[i]]; ok {\r\n            break // 找到重复的，直接退出\r\n        } else {\r\n            mp[s[i]] = i // 没找到重复的，加上这个子串\r\n        }\r\n    }\r\n\r\n    length := lengthOfLongestSubstring(s[1:])\r\n    if i > length {\r\n        return i\r\n    }\r\n    return length\r\n}\r\n\r\nfunc main() {\r\n    var s string\r\n    fmt.Scan(&s)\r\n\r\n    result := lengthOfLongestSubstring(s)\r\n    fmt.Println(result)\r\n}', NULL);
INSERT INTO `user_codes` VALUES (66, '2024-11-24 17:28:03.520', '2024-12-29 17:32:13.580', NULL, 123, 1, 'go', 'package main\r\n\r\nimport (\r\n    \"fmt\"\r\n)\r\n\r\nfunc longestPalindrome(s string) string {\r\n    n := len(s)\r\n    if n < 2 {\r\n        return s\r\n    }\r\n\r\n    maxLen := 1\r\n    begin := 0\r\n\r\n    // 中心扩展法\r\n    for i := 0; i < n; i++ {\r\n        oddLen := expandAroundCenter(s, i, i)\r\n        evenLen := expandAroundCenter(s, i, i+1)\r\n        curLen := max(oddLen, evenLen)\r\n\r\n        if curLen > maxLen {\r\n            maxLen = curLen\r\n            begin = i - (curLen-1)/2\r\n        }\r\n    }\r\n\r\n    return s[begin : begin+maxLen]\r\n}\r\n\r\nfunc expandAroundCenter(s string, left, right int) int {\r\n    L, R := left, right\r\n    n := len(s)\r\n\r\n    for L >= 0 && R < n && s[L] == s[R] {\r\n        L--\r\n        R++\r\n    }\r\n\r\n    return R - L - 1\r\n}\r\n\r\nfunc max(a, b int) int {\r\n    if a > b {\r\n        return a\r\n    }\r\n    return b\r\n}\r\n\r\nfunc main() {\r\n    var s string\r\n    fmt.Scan(&s)\r\n\r\n    result := longestPalindrome(s)\r\n    fmt.Println(result)\r\n}', NULL);
INSERT INTO `user_codes` VALUES (67, '2024-11-24 17:39:51.500', '2024-11-24 18:13:11.015', NULL, 124, 1, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\nfunc convert(s string, numRows int) string {\r\n    // 很巧妙 头尾转变方向\r\n    arr := make([]string, numRows)\r\n    if numRows < 2 {\r\n        return s\r\n    }\r\n\r\n    i, flag := 0, -1\r\n    for _, v := range s {\r\n        arr[i] += string(v)\r\n        if i == 0 || i == numRows -1 {\r\n            flag = -flag\r\n        }\r\n        i += flag\r\n    }\r\n\r\n    var result string\r\n    for i := 0; i < len(arr); i++ {\r\n        result += arr[i]\r\n    }\r\n\r\n    return result\r\n}\r\n\r\n\r\nfunc main() {\r\n    var s string\r\n    fmt.Scan(&s)\r\n\r\n    var numRows int\r\n    fmt.Scan(&numRows)\r\n\r\n    output := convert(s, numRows)\r\n    fmt.Println(output)\r\n}', NULL);
INSERT INTO `user_codes` VALUES (68, '2024-11-24 18:14:11.838', '2024-11-26 00:28:23.755', NULL, 125, 1, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\n// reverse函数用于反转一个32位有符号整数\r\nfunc reverse(x int) int {\r\n    // 定义32位有符号整数的最小值和最大值\r\n    const INT_MIN = -1 << 31\r\n    const INT_MAX = 1<<31 - 1\r\n\r\n    // 用于存储反转后的整数\r\n    var reversed int\r\n\r\n    // 根据输入整数的正负确定符号\r\n    sign := 1\r\n    if x < 0 {\r\n        sign = -1\r\n        x = -x\r\n    }\r\n\r\n    // 循环进行数字反转操作\r\n    for x!= 0 {\r\n        // 取出当前整数的最后一位数字\r\n        lastDigit := x % 10\r\n\r\n        // 检查是否会发生溢出\r\n        if reversed > INT_MAX/10 || (reversed == INT_MAX/10 && lastDigit > INT_MAX%10) {\r\n            return 0\r\n        }\r\n        if reversed < INT_MIN/10 || (reversed == INT_MIN/10 && lastDigit < INT_MIN%10) {\r\n            return 0\r\n        }\r\n\r\n        // 将取出的数字添加到反转后的整数中\r\n        reversed = reversed*10 + lastDigit\r\n\r\n        // 更新原整数，去掉已经处理过的最后一位数字\r\n        x /= 10\r\n    }\r\n\r\n    // 返回反转后的整数，并根据原整数的符号进行调整\r\n    return reversed * sign\r\n}\r\n\r\nfunc main() {\r\n    // 示例输入\r\n    num := 0\r\n    fmt.Scan(&num)\r\n    num = reverse(num)\r\n    fmt.Println(num)\r\n}', NULL);
INSERT INTO `user_codes` VALUES (69, '2024-11-24 18:19:25.257', '2024-11-24 18:20:59.769', NULL, 126, 1, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\n// isPalindrome函数用于判断一个整数是否为回文整数\r\nfunc isPalindrome(a int) bool {\r\n    if a < 0 {\r\n        return false\r\n    }\r\n\r\n    // 将整数转换为字符串\r\n    numStr := fmt.Sprintf(\"%d\", a)\r\n\r\n    // 遍历字符串的前半部分和后半部分进行比较\r\n    for i := 0; i < len(numStr)/2; i++ {\r\n        if numStr[i]!= numStr[len(numStr)-1-i] {\r\n            return false\r\n        }\r\n    }\r\n\r\n    return true\r\n}\r\n\r\nfunc main() {\r\n    // 示例输入\r\n    num := 0\r\n    fmt.Scan(&num)\r\n    a := isPalindrome(num)\r\n    fmt.Println(a)\r\n}', NULL);
INSERT INTO `user_codes` VALUES (70, '2024-11-24 18:21:11.757', '2024-11-24 18:22:51.443', NULL, 127, 1, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\n// maxArea函数用于找出给定数组中两条垂线与x轴构成容器能容纳的最大水量\r\nfunc maxArea(height []int) int {\r\n    left, right := 0, len(height)-1\r\n    maxWater := 0\r\n\r\n    for left < right {\r\n        // 计算当前两条垂线构成容器的水量\r\n        currentArea := min(height[left], height[right]) * (right - left)\r\n        // 更新最大水量\r\n        if currentArea > maxWater {\r\n            maxWater = currentArea\r\n        }\r\n\r\n        // 根据垂线高度调整指针\r\n        if height[left] < height[right] {\r\n            left++\r\n        } else {\r\n            right--\r\n        }\r\n    }\r\n\r\n    return maxWater\r\n}\r\n\r\n// min函数用于返回两个整数中的较小值\r\nfunc min(a, b int) int {\r\n    if a < b {\r\n        return a\r\n    }\r\n    return b\r\n}\r\n\r\nfunc main() {\r\n    n := 0\r\n    fmt.Scan(&n)\r\n    nums := make([]int, n)\r\n    for i := 0; i < n; i++ {\r\n        fmt.Scan(&nums[i])\r\n    }\r\n    answer := maxArea(nums)\r\n    fmt.Println(answer)\r\n}', NULL);
INSERT INTO `user_codes` VALUES (71, '2024-11-24 18:26:28.863', '2024-11-26 00:28:36.403', NULL, 128, 1, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\n// climbStairs函数用于计算爬到指定台阶数的不同方法数\r\nfunc climbStairs(n int) int {\r\n    if n == 1 {\r\n        return 1\r\n    }\r\n\r\n    a, b := 1, 2\r\n    for i := 2; i < n; i++ {\r\n        c := a + b\r\n        a = b\r\n        b = c\r\n    }\r\n\r\n    return b\r\n}\r\n\r\nfunc main() {\r\n    num := 0\r\n    fmt.Scan(&num)\r\n    answer := climbStairs(num)\r\n    fmt.Println(answer)\r\n}', NULL);
INSERT INTO `user_codes` VALUES (72, '2024-11-24 18:27:09.514', '2024-11-24 19:41:43.884', NULL, 129, 1, 'go', 'package main\r\n\r\nimport (\r\n    \"fmt\"\r\n    \"strconv\"\r\n)\r\n\r\n// addBinary函数用于计算两个二进制字符串的和，并以二进制字符串形式返回结果\r\nfunc addBinary(a, b string) string {\r\n    // 将二进制字符串转换为整数\r\n    num1, err1 := strconv.ParseInt(a, 2, 64)\r\n    num2, err2 := strconv.ParseInt(b, 2, 64)\r\n\r\n    if err1!= nil || err2!= nil {\r\n        return \"\"\r\n    }\r\n\r\n    // 计算两数之和\r\n    sum := num1 + num2\r\n\r\n    // 将和转换为二进制字符串\r\n    return strconv.FormatInt(sum, 2)\r\n}\r\n\r\nfunc main() {\r\n    a := \"\"\r\n    b := \"\"\r\n    fmt.Scan(&a)\r\n    fmt.Scan(&b)\r\n    result := addBinary(a, b)\r\n    fmt.Println(result)\r\n}\r\n', NULL);
