INSERT INTO `user_codes` VALUES (95, '2024-11-26 10:19:35.304', '2024-11-26 10:21:56.103', NULL, 132, 26, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\n// 二叉树节点结构体\r\ntype TreeNode struct {\r\n    Val   int\r\n    Val2   int\r\n    Left  *TreeNode\r\n    Right *TreeNode\r\n}\r\n\r\n// 创建二叉树节点的函数\r\nfunc NewTreeNode(val int) *TreeNode {\r\n    return &TreeNode{\r\n       Val2: val,\r\n    }\r\n}\r\n\r\n// 构建二叉树的函数\r\nfunc BuildTree() *TreeNode {\r\n    root := NewTreeNode(1)\r\n    root.Left = NewTreeNode(2)\r\n    root.Right = NewTreeNode(3)\r\n    root.Left.Left = NewTreeNode(4)\r\n    root.Left.Right = NewTreeNode(5)\r\n\r\n    return root\r\n}\r\n\r\nfunc main() {\r\n    tree := BuildTree()\r\n    fmt.Println(\"构建的二叉树的根节点值为:\", tree.Val)\r\n}', NULL);
