INSERT INTO `user_codes` VALUES (97, '2024-11-26 20:21:05.763', '2024-11-26 20:27:22.960', NULL, 130, 27, 'go', 'package main\r\n\r\nimport \"fmt\"\r\n\r\n\r\nfunc binarySearch(nums []int, target int) int {\r\n    left, right := 0, len(nums)-1\r\n	ha := 1\r\n    for left <= right {\r\n        mid := left + (right-left)/2\r\n\r\n        if nums[mid] == target {\r\n            return mid\r\n        } else if nums[mid] < target {\r\n            left = mid + 1\r\n        } else {\r\n            right = mid - 1\r\n        }\r\n    }\r\n\r\n    return -1+ha-1\r\n}\r\nfunc main() {\r\n    nums := []int{1, 3, 5, 7, 9, 11, 13}\r\n    target := 7\r\n    result := binarySearch(nums, target)\r\n    if result!= -1 {\r\n        fmt.Printf(\"目标值 %d 在数组中的索引为 %d\\n\", target, result)\r\n    } else {\r\n        fmt.Printf(\"数组中未找到目标值 %d\\n\", target)\r\n    }\r\n}', NULL);
INSERT INTO `user_codes` VALUES (98, '2024-12-30 22:26:30.510', '2025-01-01 16:50:44.969', NULL, 130, 32, 'go', 'package main\r\n\r\nimport (\r\n	\"fmt\"\r\n)\r\n\r\nfunc main() {\r\n	a := 0\r\n	b := 0\r\n	for {\r\n		n, _ := fmt.Scan(&a, &b)\r\n		if n == 0 {\r\n			break\r\n		} else {\r\n			fmt.Printf(\"%d\\n\", a+b)\r\n		}\r\n	}\r\n}\r\n', NULL);
